INSERT INTO `collection` VALUES (1,0,2,'Doraemon - Tentomusi comics','doraemon-tentomusi-comics','This is my collection of Doraemon comics',2,440,4,NULL,0,1,0,1,0,'2007-05-27 09:19:40','2010-01-27 11:32:24'),(2,767,3,'Cameras','cameras','from digital to pinhole photography',9,940,10,NULL,0,1,0,1,1,'2007-05-28 21:37:17','2010-01-31 02:45:26'),(3,33,3,'DVD','dvd','My modest DVD collection',61,1659,13,NULL,0,1,0,1,1,'2007-05-28 22:11:50','2010-02-01 18:59:43'),(6,0,6,'Slide Puzzles','slide-puzzles','A varied collection of slide puzzles that I have collected over the years',19,1053,6,NULL,0,1,0,1,0,'2007-05-30 16:30:08','2010-02-01 19:26:45'),(7,23,10,'NES Games','nes-games','8-bit Nintendo cartrtidges',NULL,216,0,NULL,0,1,0,1,1,'2007-05-31 12:11:51','2010-01-27 17:41:06'),(8,0,5,'Tanya Doskova\'s Paintings','tanya-doskova-s-paintings','Tanya Doskova is a Bulgarian-born artist living in Vancouver, BC. In 1990, Tanya moved from Sofia (Bulgaria) to London, UK, where she was featured in three solo exhibitions in Soho and had her work presented in more than 20 group exhibitions.',5,902,2,NULL,0,1,0,1,1,'2007-05-31 12:36:02','2010-01-31 19:51:43'),(9,25,13,'Cuff Links','cuff-links','I inherited much of this collection from my father, while others I received as gifts.  My personal collection includes over a dozen sets of silk knots that function as disposable cuff links.',14,624,1,NULL,0,1,0,1,1,'2007-05-31 16:51:16','2010-01-31 23:45:39'),(10,38,14,'Beach Photos','beach-photos','Beach photos',9,626,0,NULL,0,1,0,1,0,'2007-05-31 17:53:28','2010-01-31 13:20:55'),(11,34,12,'Voice-O-Graph Recordings','voice-o-graph-recordings','A collection of 1940s-1960s era recordings made in specially designed Voice-O-Graph booths by amateur vocalists and speakers, cut into 45-sized discs, playable on regular record players.',4,1900,14,NULL,0,1,0,1,1,'2007-06-01 04:53:37','2010-02-01 16:52:17'),(12,774,12,'Batman-a-phenalia','batman-a-phenalia','A collection of various non-figural, Batman-related things I\'ve somehow accumulated. The figures are located in another collection here!',25,1442,5,NULL,0,1,0,1,1,'2007-06-01 07:37:23','2010-01-31 18:29:20'),(14,8,6,'American History Books','american-history-books','This is a collection of mine about books that center specifically around the American Revolution and the Founding Fathers.',16,839,2,NULL,0,1,0,1,0,'2007-06-01 09:51:36','2010-01-29 16:31:04'),(15,34,5,'Kevin Yost Discography','kevin-yost-discography','For the past 4 years I\'ve been getting obsessive about Kevin Yost and his electronic jazz fusion. After I owned all of his official album releases, I started downloading bootlegs over the net which unfortunately I can\'t upload here ;)',9,767,1,NULL,0,1,0,1,1,'2007-06-01 11:08:38','2010-02-01 07:21:42'),(16,61,17,'Pez Dispensers','pez-dispensers','Assorted pez dispensers collected over the years.',5,538,14,NULL,0,1,0,1,1,'2007-06-01 11:34:33','2010-02-01 10:46:07'),(17,35,12,'Cephalopodia','cephalopodia','A collection of octopus and squid items that have found their way into my hands. Not only are they beautiful and fun to draw, but they\'re also both delicious. The best of both worlds.',22,1366,10,NULL,0,1,0,1,1,'2007-06-01 22:14:49','2010-01-31 15:24:38'),(18,42,12,'Kaiju','kaiju','I know very little of Kamen / Masked Rider or the various similar Japanese TV shows, but I LOVE Kaiju! Japanese movie monsters are some of my favorite kinds of monsters. I don\'t know what they\'re called, but I know I like \'em!',42,929,6,NULL,0,1,0,1,1,'2007-06-02 22:16:01','2010-01-30 01:53:08'),(22,6,12,'The Art of Dave McKean','the-art-of-dave-mckean','Illustrator Dave McKean was my first indication that art could span genres and be more than one thing at once - very inspiring for a young artist. Over the years, I\'ve actively sought out everything he\'s put his art to, including a lot of limited and signed items.',8,1072,2,NULL,0,1,0,1,1,'2007-06-03 18:53:49','2010-02-01 19:50:57'),(24,269,6,'Stone Egg Collection','stone-egg-collection','Bowls and bowls of stone eggs purchased on a whim whenever I\'m out shopping or traveling',15,1031,4,NULL,0,1,0,1,0,'2007-06-04 11:53:37','2010-02-01 02:00:35'),(26,35,20,'Vanity Items','vanity-items','Antique Hand Mirror\'s Sterling Silver, Silver Plate',4,556,1,NULL,0,1,0,1,1,'2007-06-04 19:16:43','2010-01-29 20:23:17'),(27,42,12,'Robot Invasion','robot-invasion','Robots. Everywhere. From all matter of manufacturers and years and genres. ',19,956,4,NULL,0,1,0,1,1,'2007-06-04 20:31:31','2010-01-30 13:56:35'),(28,33,8,'Blade Runner','blade-runner','Anything having to do with the film Blade Runner, with some exceptions',6,918,6,NULL,0,1,0,1,0,'2007-06-05 16:18:47','2010-01-31 06:03:21'),(29,38,24,'Amsterdam','amsterdam','one trip in a flat country',3,372,0,NULL,0,1,0,1,0,'2007-06-05 16:47:20','2010-01-31 02:22:04'),(30,34,25,'Joey Youngman','joey-youngman','The EPs from one of new school house\'s greatest producers and DJs.',12,567,1,NULL,0,1,0,1,1,'2007-06-05 18:03:35','2010-01-30 23:51:46'),(32,6,7,'Art by Lena Liv','art-by-lena-liv','For several years, my wife and I have been fascinated by the art of an artist named Lena Liv.  Lena currently reside in Tuscany, but is originally from Russia and Israel.',0,179,0,NULL,0,1,0,1,0,'2007-06-05 20:39:09','2010-01-20 13:21:57'),(34,51,29,'Soccer Jerseys','soccer-jerseys','These are a collection of soccer jerseys that I\'ve bought or received during my and my friends\' travels around the world. There aren\'t any old-style jerseys from teams that played before I was born or anything like that.  These are often just mementos that I or my friends have gathered that now sit in a drawer in my room.  In fact, I wear a lot of them while running or playing soccer.',14,889,4,NULL,0,1,0,1,1,'2007-06-05 22:48:11','2010-02-01 13:36:30'),(35,33,10,'Video collection','video-collection','Movies on VHS, DVD, Laserdisc',NULL,276,0,NULL,0,1,0,1,1,'2007-06-06 13:25:09','2010-01-23 10:45:37'),(36,8,5,'My bookshelf','my-bookshelf','I\'m an avid reader. I read everything from hardcore physics and neuroscience to fiction and old classics.',22,1870,0,NULL,0,1,0,1,1,'2007-06-07 12:08:22','2010-02-01 22:38:07'),(37,52,36,'Green Turtle Pictures','green-turtle-pictures','Various pictures of green sea turtles observed all over the world',1,312,2,NULL,0,1,0,1,1,'2007-06-12 22:48:45','2010-01-31 08:57:21'),(40,269,38,'Wooden Eggs','wooden-eggs','Wooden Eggs',8,728,3,NULL,0,1,0,1,1,'2007-06-15 16:25:25','2010-01-31 18:31:32'),(41,47,5,'My Sneakers','my-sneakers','Old and new skool kicks ',9,783,0,NULL,0,1,0,1,0,'2007-06-16 01:58:38','2010-02-01 04:56:16'),(42,17,5,'My Hoodies','my-hoodies','Hardcore culture',3,646,0,NULL,0,1,0,1,0,'2007-06-16 02:11:07','2010-01-30 12:36:30'),(43,35,3,'Illustrations','illustrations','Cute items to pretty up my mac! This is pretty much a virtual collection...',18,682,3,NULL,0,1,0,1,1,'2007-06-17 22:17:37','2010-01-28 07:09:42'),(45,101,52,'Dinosaur Toys','dinosaur-toys','Dinosaur toys from the 1920s to today.',141,5629,40,NULL,0,1,0,1,1,'2010-01-11 22:16:19','2010-02-01 21:48:52'),(46,101,52,'Dinosaur Games','dinosaur-games','Games featuring dinosaurs and other prehistoric animals.',10,1420,2,NULL,0,1,0,1,1,'2007-06-19 02:49:20','2010-02-01 17:29:31'),(47,731,52,'Dinosaur Pins','dinosaur-pins','Pins featuring dinosaurs and other prehistoric animals.',6,925,1,NULL,0,1,0,1,1,'2007-06-19 10:17:29','2010-01-28 17:55:02'),(48,101,52,'Dinosaur Stamps','dinosaur-stamps','Stamps featuring images of dinosaurs and other prehistoric animals.',4,807,1,NULL,0,1,0,1,1,'2007-06-19 12:14:31','2010-02-01 02:18:32'),(49,8,53,'Harrypotter','harrypotter','its from the harry potter movie',6,639,0,NULL,0,1,0,0,1,'2007-06-19 22:03:29','2010-02-01 03:06:23'),(50,101,52,'Dinosaur Books','dinosaur-books','Books about dinosaurs and other prehistoric animals.',65,1264,8,NULL,0,1,0,1,1,'2009-05-06 23:17:16','2010-01-31 19:19:04'),(51,101,52,'Dinosaur Magazines','dinosaur-magazines','Magazin