for my own curiosity than anything) I will send you virtual hugs over the internets :-)',NULL,116,0,NULL,0,1,0,1,1,'2007-06-21 13:24:48','2010-01-24 15:21:03'),(61,16,56,'Webcomic originals','webcomic-originals','Original panels from webcomics, and custom drawings by webcomic artists.',NULL,144,0,NULL,0,1,0,1,1,'2007-06-21 16:59:44','2010-01-14 23:46:09'),(63,19,57,'MY HAPPY COLLECTION','my-happy-collection',' CARROT TOP PATTY',2,173,0,NULL,0,1,0,0,0,'2007-06-22 01:24:22','2010-01-28 03:18:12'),(64,18,57,'PRAYERS AND PROMISES','prayers-and-promises','THEY ALL DEPICT GUARDIAN ANGELS HELPING CHILDREN',NULL,112,0,NULL,0,1,0,0,0,'2007-06-22 02:21:59','2010-01-31 11:11:59'),(70,101,52,'Dinosaur Restaurant and Fast Food Premiums','dinosaur-restaurant-and-fast-food-premiums','Dinosaurs have always made popular restaurant and fast food premiums - the free toy included with the child\'s meal.  These regularly show up at garage sales so its pretty easy to start a collection.',55,1656,4,NULL,0,1,0,1,1,'2009-07-02 11:22:00','2010-02-01 23:29:22'),(71,28,5,'Popular Science Magazines','popular-science-magazines','I got those at a flea market next to my house. Most of those are from the late 70s and some of the articles are just hilarious.',6,620,0,NULL,0,1,0,1,0,'2007-06-23 21:41:53','2010-02-01 10:49:39'),(72,28,5,'Stereo Review Magazines','stereo-review-magazines','Got them at a flea market. Most of those are from the early 80s.',8,667,1,NULL,0,1,0,1,0,'2007-06-23 22:15:14','2010-01-30 19:44:44'),(73,19,61,'Vintage & Mod Barbies Restoration','vintage-mod-barbies-restoration','Krista\'s Doll Restoration -- www.dollrestoration.com',NULL,302,0,NULL,0,1,0,1,1,'2007-06-25 21:28:15','2010-01-26 21:47:43'),(74,273,8,'Random Figurines','random-figurines','Little things I\'ve collected over the years',14,1811,4,NULL,0,1,1,1,1,'2007-06-27 19:26:13','2010-02-01 17:16:47'),(75,101,52,'Stuffed Dinosaurs','stuffed-dinosaurs','Plush, cloth, stuffed, dino-dolls, whatever you want to call them!',14,1097,2,NULL,0,1,0,1,1,'2007-06-28 10:18:51','2010-02-01 16:45:34'),(76,101,52,'Dinosaur Pressed Pennies','dinosaur-pressed-pennies','Prehistoric-themed elongated coins from museums and other attractions.',7,770,4,NULL,0,1,0,1,1,'2007-06-28 11:20:11','2010-02-01 14:17:25'),(77,54,12,'Demon\'s Chronicle Mini-figures','demon-s-chronicle-mini-figures','An odd collection of mini sculptures from the Yanoman Company in Japan. Very hard to get in the US, so I had to import these myself. They\'re based on various mythologies, and a lot of bizarre original creations. There are ten series, and these are a few.',57,2426,12,NULL,0,1,0,1,1,'2007-06-29 22:12:15','2010-02-01 10:15:14'),(78,16,12,'Big Apple Comic Book, Art, Toy & Sci-Fi Expo 2007','big-apple-comic-book-art-toy-sci-fi-expo-2007','Held in the Pennsylvania Hotel, here\'s some photos from this year\'s Big Apple Comic Con.',18,1354,3,NULL,0,1,0,1,1,'2007-06-30 13:45:39','2010-01-30 03:35:22'),(83,21,59,'Kitschy Animal Figurines With Bow Ties','kitschy-animal-figurines-with-bow-ties','These began just as \'art\' for the Kitschy-Kitschy-Coo website -- Nice excuse, huh?  *wink*',4,994,1,NULL,0,1,0,1,1,'2007-07-02 17:12:24','2010-02-01 16:38:47'),(84,21,59,'Vintage Ceramic Figurines With Fur Applique','vintage-ceramic-figurines-with-fur-applique','I have no idea what these are called.  If I did, I\'d have more of them.',9,1214,4,NULL,0,1,0,1,1,'2010-01-11 19:04:40','2010-02-01 22:11:37'),(85,42,59,'Nodders & Bobble Heads','nodders-bobble-heads','Small smattering of nodders & bobble heads.',5,578,2,NULL,0,1,0,1,1,'2007-07-02 18:27:07','2010-01-30 07:41:23'),(86,8,59,'Edgar Rice Burroughs Paperbacks','edgar-rice-burroughs-paperbacks','Vintage sci-fi paperbacks by the delicious Edgar Rice Burroughs.',6,623,0,NULL,0,1,0,1,1,'2007-07-02 19:47:27','2010-01-30 22:16:45'),(87,35,59,'Vintage Storks','vintage-storks','Birds that bring babies (because cabbage isn\'t quite as cute to collect).',5,1023,1,NULL,0,1,0,1,1,'2009-03-11 1