age Sale Finds','august-3-2007-garage-sale-finds','Today was a good garage sale day for me!  I slept in and wasn\'t planning on going to sales today, but my wife was looking through the ads and found one that advertised \"large dinosaur collection.\"  Well, I was ready to go in a second!  But it was 10:30 and the sale started at 8.  Would there be anything left?  Well, there was - here is everything I bought - all for $20.',18,768,4,NULL,0,1,0,1,1,'2007-08-03 15:32:54','2010-01-30 15:51:24'),(200,21,82,'vinyl & beyond','vinyl-beyond','the figures I have, casual collection home and work.',11,683,5,NULL,0,1,0,1,1,'2007-08-03 16:39:06','2010-02-01 06:57:22'),(201,24,12,'DC Comics Pepsi Glasses','dc-comics-pepsi-glasses','Two different series of DC Comics themed Pepsi glasses were released in the 1970s-80s. The earlier glasses feature the same image on both sides, and the character framed by a large circle, or a \'moon\'. The later series featured the image of a character on one side and their logo on the reverse.',17,2150,3,NULL,0,1,0,1,1,'2007-08-04 01:15:31','2010-02-01 18:42:06'),(202,16,114,'I Go POGO','i-go-pogo','My small collection of the greatest daily strip there ever was',1,342,1,NULL,0,1,0,1,1,'2007-08-04 04:20:49','2010-01-25 09:04:37'),(203,34,114,'10inch records','10inch-records','records that are ten inches wide, also ten inches across........and round........and flat',2,356,0,NULL,0,1,0,1,1,'2007-08-04 05:14:31','2010-01-23 19:31:49'),(204,16,114,'PLOP!','plop','Plop! was a great little comic that had a short run during the seventies. It imitated the \"underground\" comics which it was anything but (put out by DC). Featured great artists such as Sergio Aragones & Wally Wood. Then eventually it allowed ads & spiralled down into suckdom.',1,359,1,NULL,0,1,0,1,1,'2007-08-04 06:22:57','2010-01-24 06:47:05'),(205,35,124,'Dachshunds!','dachshunds','I have a place in my heart for the little critters and have developed a small collection around them.  ',9,2262,