arge variety of independent comic characters.',7,1622,2,NULL,0,1,0,1,1,'2007-08-09 21:15:24','2010-02-01 05:59:03'),(217,51,29,'Running Shirts','running-shirts','This is a modest portion of my collection of running shirts from races starting in 2004 to the present.',26,563,0,NULL,0,1,0,1,1,'2007-08-12 16:12:26','2010-02-01 15:23:55'),(218,753,132,'Elvis Presley Collection','elvis-presley-collection','Things that I have collected over the years.',36,1588,25,NULL,0,1,0,1,1,'2007-08-12 18:09:50','2010-02-01 06:46:07'),(219,37,12,'Through The Viewfinder Photography','through-the-viewfinder-photography','A photographic technique that produces in-camera distortions and a vintage appearance. These use a collection of Kodak Duaflex cameras and a Canon Powershot.',13,854,0,NULL,0,1,0,1,1,'2007-08-17 21:11:51','2010-01-27 11:32:40'),(227,780,140,'My Teacups','my-teacups','This is my teacup collection.  Believe it or not most of these came from a teacup collector before me.....I thought they were beautiful and each had distinctive colors.  If you know anything about any of these feel free to comment or contact me.....',58,15910,20,NULL,0,1,1,1,1,'2007-08-19 21:28:10','2010-02-01 20:36:37'),(228,752,143,'awesome records','awesome-records','Some great vinyl from my vast collections',24,1009,0,NULL,0,1,0,1,1,'2007-08-22 00:10:29','2010-02-01 06:57:25'),(229,101,52,'Metal Dinosaur & Prehistoric Figures','metal-dinosaur-prehistoric-figures','These are prehistoric animal figures made out of metal.',16,2079,10,NULL,0,1,0,1,1,'2007-08-22 10:44:15','2010-02-01 22:40:47'),(230,1,12,'Marvel World by Famosa','marvel-world-by-famosa','Not sold within the US and made in Spain, Famosa\'s Marvel World toys are about 3\" tall and totally cute. They all have double-sided faces, a few accessories, and stands. Some come in 2-packs, and some in larger playsets, kinda like Playmobil stuff!',5,1719,0,NULL,0,1,0,1,1,'2007-08-24 23:45:19','2010-02-01 18:46:21'),(231,1,12,'DC Superfriends by Mattel','d