ased around the same time (and kept with this collection) were some two-packs of teams or arch-enemies.',9,719,2,NULL,0,1,0,1,1,'2007-11-19 19:29:22','2010-01-28 12:06:54'),(284,21,199,'DreamSicles','dreamsicles','Several Dreamsicles to Numbers for birthdays to Christmas tree to Horse',NULL,137,0,NULL,0,1,0,1,1,'2007-11-20 11:58:04','2010-01-29 04:17:23'),(285,55,150,'TMNT VHS/Laser Disk/DVD Collection','tmnt-vhs-laser-disk-dvd-collection','I collect every TMNT DVD that I can get my hands on.  As long as money allows it, I\'ll get it.  And so far even though I don\'t own every TMNT DVD out there I do have a lot and I\'ll like to share what I have with you all.\r\n\r\nI also have VHS collection and some Laser Disks to share as well!  Hope everyone Enjoys!',87,1826,0,NULL,0,1,0,1,1,'2007-11-22 22:46:21','2010-01-31 18:26:07'),(286,35,200,'Comic Book and Cartoon Characters','comic-book-and-cartoon-characters','This is a comic book character and cartoon character collection. When the other categories like comic books, action figures and such doesn\'t fit.',4,524,0,NULL,0,1,0,1,1,'2007-11-23 17:23:22','2010-01-28 06:23:28'),(287,36,150,'Scripts!','scripts','I\'ve been collecting TMNT scripts since the 90\'s.  This is where I\'ll place all the scripts that I have.  Two movie Scripts, One comic book script, and over 20 Next Mutation Scripts all autographed!',29,1272,5,NULL,0,1,0,1,1,'2007-11-25 20:59:00','2010-02-01 09:48:09'),(288,39,150,'Ivey\'s Pin collection','ivey-s-pin-collection','I\'ve got a small TMNT pin and button collection, though I\'m sure I got more through the house as I find them I\'ll update this area.',55,951,1,NULL,0,1,0,1,1,'2007-11-27 00:31:40','2010-02-01 09:47:40'),(289,42,207,'Star Wars Revenge Of the Sith Stands and More','star-wars-revenge-of-the-sith-stands-and-more','This is part of a collection from the Movie Release Star Wars Revenge of The Sith. This collection includes 7 card board stands featuring the following characheters. Obi-Won Kenobi, Yoda, Chewbacca, Darth Vader, Bobbafet, Luke Skywalker, Young Darth vader ( I can;t remember his name right now I will find out) and one that has both R2-D2 and C3-PO on it.  and a few more I am including.  Each stand is about 4 feet tall and has a place in the top right hand corner with a hand.  In this hand you place your hand and the warmth from your body will reveal a special message to the viewer.  Each stand comes with a metal stand for easy display.  At the bottom of each stand is the sponsor from that stand including Pop-Tarts, M & M\'s, Lego and other sponsors.  I am also including a 36 foot sign that was supposed to have been hung on the side of the promotional tent.  It was never hung up due to bad weather.  I am also including the training DVD and Materials used to train the promotional marketing managers for this event. All the stands are in excellent condition and I have kept them up and free from moisture. I am also including 3 light sabers.  They were taken out for display, but put back in to the box and never used again. I have the Obi-Won Kenobi, Darth Vader and Yoda Light Sabers.  I am also including a 30th Anniversayt Coin Ablum with Figure #1 Darth Vader and Exclusive Collector oin with a 5 Panel Album with Full color outer Mural. I am having trouble getting this site to accept my pictures, but I can e-mail them to you if you wish.  I am trying to get this on so everyone can see.  For some reason when I get it on, it goes to a blank screen and does not take my info.  If you know anyone interested in this collection as a whole let me know.  ',NULL,160,0,NULL,0,1,0,1,1,'2007-11-28 14:45:59','2010-01-11 00:10:20'),(290,35,29,'Physics Experimental Equipment','physics-experimental-equipment','This is a collection of \"vintage\" physics experimental equipment that\'s been stored away for more than a few years at school. There are random mercury tubes and samples in places, so I\'m probably well over my FDA-recommended lifetime mercury exposure limit