1,1,'2008-05-27 17:08:29','2010-02-01 14:27:54'),(552,101,591,'Battat Collection ','battat-collection','1/40 scale figures by Boston Museum of Science Dinosaur Collection. Some of the most accurate dinosaur figures ever produced. Three sets have been produced plus a mini set. Very rare and hard to find. 1990\'s now out of production. Figures sculpted by Dan LoRusso \r\nand Greg Wenzel of the Dinosaur Studio. Check out the original plaster mold models.\r\n\r\nWalking With Dinosaur (WWD)\r\nFigures based on the BBC hit series Walking with Dinosaur. Toyway in England released the official toy line for the series. The \"other\" WWD in my collection is the unofficial one made by some company in China. The figures were very obviously based on the series.',62,1953,11,NULL,0,1,0,1,1,'2009-05-17 23:38:42','2010-01-30 01:48:39'),(553,20,597,'Starbucks mug collection','starbucks-mug-collection','Starbucks Coffee Mug Collection',6,1826,0,NULL,0,1,0,1,1,'2008-05-29 11:18:05','2010-02-01 19:21:49'),(555,273,599,'pez','pez-2','A candy dispenser that got a life of his own in the modern world. It\'s fun, it\'s colorful, it makes me happy!!!!',46,444,2,NULL,0,1,0,1,1,'2009-08-22 14:02:19','2010-01-29 03:26:55'),(556,1,125,'action figures and transformers','action-figures-and-transformers','well ,where to begin?\r\ni have been collecting action figures and transformers for the last 12 years\r\nmainly figures from cartoons that i grow up watching or just cause i like the way they look \r\ni like to play with my toys (though i\'m 28 yrs old/young) and i dont keep those poor toys in their plastic bubble covers my toys like the open air and alot of human touch :)\r\n\r\n',NULL,102,0,NULL,0,1,0,1,1,'2008-05-29 12:49:13','2010-01-26 18:07:35'),(557,2,572,'Beer Trays','beer-trays','No matter where I look I always seem to stumble over a \r\nbeer tray or two or three.',41,901,2,NULL,0,1,0,1,1,'2009-08-20 12:41:05','2010-02-01 15:29:53'),(558,101,591,'Museum Lines','museum-lines','Dinosaur figures endorsed by a major museums. Figures mostly done in similar scale (1/40). High details reflecting the latest scientific discovery. Invicta, Safari,Bullyland,ROM,Schleich are some of the major lines.',62,1153,7,NULL,0,1,0,1,1,'2008-05-29 17:05:52','2010-01-31 12:23:49'),(559,101,591,'Prehistoric Mammals collection','prehistoric-mammals-collection','Prehistoric mammal figures from various company. The prehistoric mammal line is not as big as the dinosaur ones. Only a handful of company make them making some out of production figures highly sought after.',85,2834,23,NULL,0,1,0,1,1,'2009-10-07 01:43:40','2010-02-01 19:01:42'),(560,60,596,'Snkr Frkr','snkr-frkr','Kicks Galore',12,364,1,NULL,0,1,0,1,1,'2008-05-30 22:59:55','2010-01-30 08:17:13'),(561,19,58,'MY PLAY PAL FAMILY','my-play-pal-family','PETER, HAS 2 SISTERS PATTY AND PENNEY. ',10,382,0,NULL,0,1,0,1,1,'2008-06-04 21:14:38','2010-01-23 14:42:11'),(562,66,607,'Wonder Woman Collection','wonder-woman-collection','Currently my Wonder Woman collection features around 1000 pieces - everything ranging from newspaper clippings, comic books, aciton figures, statues, puppets, greeting cards, shoes and roller skates, posters, magazines, books, records.... and just about everything else imaginable. ',25,1503,3,NULL,0,1,0,1,1,'2008-06-04 23:42:10','2010-02-01 22:10:31'),(563,21,12,'Gus Fink\'s Boogily Heads','gus-fink-s-boogily-heads','An extensive series of mini-sculptures created by Gus Fink & produced by Rocket USA. Each figure includes a mini-comic backed with a poster, and all have bobble-head action!',27,662,1,NULL,0,1,0,1,1,'2008-06-05 11:17:09','2010-01-30 05:07:24'),(564,61,15,'PEZ!!!','pez-3','====',14,317,0,NULL,0,1,0,1,1,'2008-06-05 16:24:28','2010-01-31 14:40:30'),(565,61,612,'Jeromy\'s PEZ Collection','jeromy-s-pez-collection','a 12 year old PEZ collection',61,737,0,NULL,0,1,0,1,1,'2008-06-06 10:15:16','2010-02-01 21:38:25'),(568,61,614,'PEZ','pez-4','129 Pez dispensers.',20,535,2,NULL,0,1,0,1,1,'2008-06-06 15:49:50','2010-02-01 23:12:47'),(569,21,615,'Homies','homies','A series of figures by David Gonzales.  I started collecting them from the gumball machine, and we have a whole room of \'homies\' stuff!  =))',NULL,119,0,NULL,0,1,0,1,1,'2008-06-07 23:05:53','2010-01-31 16:23:14'),(574,42,619,'Vintage Metal Lunchboxes','vintage-metal-lunchboxes','I\'ve started collecting lunchboxes in the early eighties. I\'d pick them up at yard sales (along with scary clown paintings) for around a buck each.',12,1453,4,NULL,0,1,0,1,1,'2008-06-09 17:15:02','2010-02-01 23:30:00'),(575,61,619,'Kevin\'s Pez Dispensers','kevin-s-pez-dispensers','My Pez collection is comprised of 412 dispensers. All have been removed from the package and displayed in a plexiglass \"stadium step\" display.',16,600,3,NULL,0,1,0,1,1,'2008-06-09 17:25:02','2010-02-01 17:20:29'),(576,61,598,'PEZ','pez-5','PEZ Dispensers',17,576,1,NULL,0,1,0,1,1,'2008-06-10 07:14:30','2010-01-27 09:57:23'),(578,62,621,'My Vintage Star Wars 1977-1984 Toy Collection','my-vintage-star-wars-1977-1984-toy-collection','I\'ve been a Star Wars collector since I saw the original in Philly at the old [Sameric] Eric Twin Fairless Hills opening day back in that awesome summer of 1977.  This is some of my collection. Over the next few weeks I hope to post more. Having collected for 30 years now,  I have stuff in boxes I still want to put on display. Plus I have a lot of original movie memorabilia, posters, lobby cards, press kits etc... that I want to get photographed and uploaded. I know my collection pales in comparison to many others, but this is my childhood, and some of my fondest memories have come from this. Nothing will ever beat that \"Summer Of 77\'\" when the \"Force\" was new and shared world wide. :)',42,943,6,NULL,0,1,0,1,1,'2008-06-10 12:34:55','2010-02-01 18:39:41'),(579,61,609,'Pez room 1','pez-room-1','room view 1',18,784,5,NULL,0,1,0,1,1,'2008-06-10 23:13:22','2010-01-31 10:53:13'),(580,19,624,'The Great Eras Collection','the-great-eras-collection','This was my very first collection from Barbie\'s World Culture line of dolls.  Acquired mostly on Ebay, these dolls represent the most famous eras of our world.',11,530,2,NULL,0,1,0,1,1,'2008-06-11 14:47:04','2010-01-31 06:00:25'),(582,19,624,'Festivals of the World','festivals-of-the-world','This new series represents some of the most famous festivals celebrated across the globe.  Although the faces are not unique on this collection, I love the colorful outfits.',10,269,0,NULL,0,1,0,1,1,'2008-06-11 14:55:01','2010-02-01 17:21:51'),(583,63,624,'Dolls of the World - Princess Collection','dolls-of-the-world-princess-collection','These are some of my favorite dolls - each one has a facial structure that is similar to the ethnicity of the culture represented. I find each one to be quite beautiful.',23,674,0,NULL,0,1,0,1,1,'2008-06-11 19:41:14','2010-02-01 10:31:26'),(584,19,624,'Legends of Ireland','legends-of-ireland','I love this collection - mostly because I love Irish history.  I thought it was a fantastic idea to create a series of dolls that represent they mythical past of this beautiful culture.',6,505,0,NULL,0,1,0,1,1,'2008-06-11 20:03:38','2010-01-31 19:51:36'),(585,19,624,'Assorted Dolls of the World ','assorted-dolls-of-the-world','These dolls are not part of a specific collection, but are termed \"World Culture\" by Barbie.  The case contains the entirety of my cultural Barbie collection.  I\'m looking forward to acquiring more as time goes by. ',17,834,5,NULL,0,1,0,1,1,'2008-06-11 20:10:22','2010-01-31 18:20:23'),(586,61,608,'PEZ!!!','pez-6','The best of my collection.',23,456,4,NULL,0,1,0,1,1,'2008-06-12 10:28:46','2010-01-28 15:10:48'),(590,101,52,'June 6 2008 Garage Sale Finds','june-6-2008-garage-sale-finds','These are some things I bought at garage sales on June 6 2008',14,993,2,NULL,0,1,0,1,1,'2008-06-14 03:46:06','2010-01-31 12:34:56'),(591,62,627,'Star Wars Vintage Action Figures 1977-1985','star-wars-vintage-action-figures-1977-1985','A near complete collection of vintage Star Wars action figures, produced between 1977 and 1985.  The collection includes several of the rare last 17 set.',24,5954,6,NULL,0,1,0,1,1,'2008-06-14 05:35:39','2010-02-01 19:51:06'),(592,63,628,'Steffie Barbie Dolls','steffie-barbie-dolls','The Steffie mold has been used on Barbie dolls since 1971.  It is the longest running face mold produced by Mattel.  The dolls using this mold span all ranges of ethnicities and styles from the 70s to today.',10,1321,3,NULL,0,1,0,1,1,'2008-06-14 06:26:49','2010-02-01 20:45:52'),(594,63,628,'Model Muse Barbie Dolls','model-muse-barbie-dolls','Mattel introduced the model muse body sculpt in 2004.  A variety of collector dolls and playline dolls are now available with this new model-like body.  ',10,1781,0,NULL,0,1,0,1,1,'2008-06-16 02:41:10','2010-02-01 21:48:18'),(595,56,59,'Garbage Pail Kids','garbage-pail-kids','Mixed Topps GPK Series -- cards from the mid 80\'s.',102,5341,5,NULL,0,1,0,1,1,'2008-06-16 03:20:43','2010-02-01 23:56:07'),(596,6,632,'Shepard Fairey','shepard-fairey','shepard fairey posters',4,276,0,NULL,0,1,0,1,1,'2008-06-16 23:50:26','2010-02-01 17:46:52'),(597,63,628,'Lord of the Rings Barbies','lord-of-the-rings-barbies','In 2003 Mattel announced a series of Lord of the Rings Barbie dolls as a tribute to the Lord of the Rings movies released between 2001 and 2003.',3,872,1,NULL,0,1,0,1,1,'2008-06-17 03:31:12','2010-02-01 12:46:12'),(598,6,1,'The Affordable Art Fair 2008','the-affordable-art-fair-2008','Held June 2008 at SoHo\'s Metropolitan Pavilion in NYC, the AAF gathered together all styles and genres of artwork under one roof, and all for sale. Photos by Collin David.',29,588,0,NULL,0,1,0,1,1,'2008-06-18 09:52:52','2010-01-31 15:45:53'),(599,62,629,'I Think I Might Like Star Wars','i-think-i-might-like-star-wars','Selected pieces from my ever increasing Star Wars collection',30,987,2,NULL,0,1,0,1,1,'2009-08-05 03:23:13','2010-01-30 12:47:33'),(600,62,635,'Vintage Star Wars','vintage-star-wars','Most items are vintage from the first trilogy.',39,699,12,NULL,0,1,0,1,1,'2008-06-18 18:43:45','2010-02-01 02:55:37'),(601,60,636,'Ian\'s SBs pt. 1','ian-s-sbs-pt-1','My Nike Sb Collection from June 07- June 08',17,725,0,NULL,0,1,0,1,1,'2008-06-19 20:42:07','2010-01-30 20:10:33'),(602,62,638,'Star Wars action figures','star-wars-action-figures','This is the Star Wars room that my wife designed. Though it\'s still kind of empty, I look forward to filling it with more memorabilia as time goes by!',16,457,2,NULL,0,1,0,1,1,'2008-06-20 13:15:10','2010-01-30 02:44:14'),(606,47,640,'My collection as of May 2008','my-collection-as-of-may-2008','This picture is a little old, have some recent pick ups just been busy to take them all out and do a re shoot. wil do soon',6,423,0,NULL,0,1,0,1,1,'2008-06-21 16:50:44','2010-02-01 11:39:43'),(608,63,628,'Fashion Fever Barbies','fashion-fever-barbies','Fashion Fever Barbies are considered playline or pink box barbies.  Mattel introduced this collection in 2004 and it has appealed to a wide range of collectors because of the realistic fashions and beautiful dolls from the waves initially released.  ',4,552,1,NULL,0,1,0,1,1,'2008-06-22 02:05:00','2010-02-01 15:29:56'),(609,101,591,'Prehistoric Marine Reptiles collection','prehistoric-marine-reptiles-collection','Collections of prehistoric marine reptiles from various toy makers.',70,1528,16,NULL,0,1,0,1,1,'2010-01-12 16:57:56','2010-02-01 08:06:25'),(610,101,591,'The Sauropod Collection','the-sauropod-collection','The sauropods, the reason I got started in collecting dinosaur figures. When I started, I originally only collected Sauropod and Ceratopsian figures. They are my favorite dinosaur group. We now all know that I have branched out into other dinosaur group and prehistoric mammals. Still, I make it a priority to seek out and acquire new sauropod and ceratopsian figures. My last count revealed an astonishing diversity of species represented in various toy lines. Safari leads the pack with with Brachiosaurus, Apatosaurus, Diplodocus, Camarasaurus, mamenchisaurus, Amargasaurus, and Saltasaurus, total of seven figures! Invicta is next with Brachiosaurus, Diplodocus, Apatosaurus, Mamenchisaurus (the first ever), and Cetiosaurs ( another first and still currently the only one ever made), total of five figures. Procon is quickly catching up with their Brachisaurus, Amargasaurus, Agustinia, Rabbachisaurs, and Shunosaurus, total of five, the last three are first ever figures.\r\nThe other company have the standard 2-3 sarupod figure, mostly the big three: Brachiosaurus, Diplodocus, Apatosaurus. My hope is that we will see more new release featuring species never before made as a toy figure. ',41,1188,3,NULL,0,1,0,1,1,'2009-04-11 23:52:54','2010-02-01 10:17:57'),(611,101,591,'The Ceratopsians Collection','the-ceratopsians-collection','One of the most famous group of dinosaurs. Almost every dinosaur toy line has one or more of the horned kind. Some of the most obscure species are starting to show up in the market. My other favorite group of dinosaurs.',41,1011,2,NULL,0,1,0,1,1,'2008-06-23 19:59:11','2010-01-31 19:48:18'),(612,101,591,'Old collectables 1950 - 1970','old-collectables-1950-1970','Marx, Ajax, MPC,Nabisco,Timmee toys, and other older dinosaur models. The beginning of all the toy lines. Highly collectable items.',9,858,3,NULL,0,1,0,1,1,'2008-06-23 21:19:09','2010-02-01 13:27:32'),(613,101,591,'Unknown manufacturer/ Dollar store dinosaurs','unknown-manufacturer-dollar-store-dinosaurs','Some unknown manufacturer dinosaurs usually found at dollar store or bin items. Some really cool ones (usually copied from major museum lines, Kaiyodo is a popular one). Mostly made in China. Production is unpredictable like many unknown lines, so if you see some really cool dinos from some unknow maker get them before they go extinct. ',5,605,2,NULL,0,1,0,1,1,'2008-06-23 21:54:14','2010-01-29 18:33:09'),(614,101,591,'The Pterosaurs (Flying Reptiles)','the-pterosaurs-flying-reptiles','Pterosaurs from various toy makers. From the popular pteranodon to the more obscure ones from Japan. Some really cool looking ones from Kaiyodo and other Japanese company.',33,928,4,NULL,0,1,0,1,1,'2009-04-25 17:53:53','2010-01-31 06:10:25'),(615,61,602,'My Pez dispensers','my-pez-dispensers','My pez collection.',5,570,1,NULL,0,1,0,1,1,'2008-06-24 14:32:25','2010-02-01 17:46:31'),(616,10,644,'Continental Collection','continental-collection','I collect all things \"Continental\". ',10,270,0,NULL,0,1,0,1,1,'2008-06-24 17:17:53','2010-01-28 06:24:09'),(617,60,646,'My Sneakers............','my-sneakers-2','Kickz 4 life.....',3,472,0,NULL,0,1,0,1,1,'2008-06-25 09:43:00','2010-01-28 11:15:26'),(618,6,644,'Metal art','metal-art','Our collection is too large to post together so I\'ve split it into Metal art, Ceramics, Glass and Graphic art.',60,709,6,NULL,0,1,0,1,1,'2008-06-25 16:15:32','2010-01-31 18:50:48'),(619,6,644,'Wood collection','wood-collection','Everything we collect has a high degree of difficulty. Our wood pieces are no exception.',27,636,4,NULL,0,1,0,1,1,'2008-06-25 21:56:38','2010-01-29 19:26:26'),(620,61,603,'PEZ Trucks','pez-trucks','PEZ dispensing trucks',14,562,0,NULL,0,1,0,1,1,'2008-06-25 22:20:35','2010-02-01 22:41:52'),(621,61,603,'PEZ on Display','pez-on-display','misc shots of various display cases in my collection',10,497,0,NULL,0,1,0,1,1,'2008-06-25 22:27:40','2010-01-31 18:31:20'),(622,61,603,'Misc PEZ & Licensed Toys','misc-pez-licensed-toys','Various PEZ dispensers, different characters, and licensed toy items.',21,415,0,NULL,0,1,0,1,1,'2008-06-25 22:35:17','2010-02-01 02:40:25'),(623,61,622,'Pez dispensers','pez-dispensers-4','My collection of pez things over the last 20 years...',11,558,0,NULL,0,1,0,1,1,'2008-06-26 11:35:06','2010-02-01 21:59:29'),(624,61,649,'Vintage PEZ dispensers','vintage-pez-dispensers','This is a pretty good selection of our vintage collection... always looking for more to fill in the gaps.',23,1315,6,NULL,0,1,0,1,1,'2008-06-27 01:13:28','2010-02-01 19:31:40'),(625,10,103,'Maisto Pro-Rodz','maisto-pro-rodz','Collectable Custom Die cast models.',NULL,155,0,NULL,0,1,0,1,1,'2008-06-30 05:30:11','2010-02-01 03:53:26'),(626,6,59,'My Altered Art','my-altered-art','My attempts to brave the \"destruction\" of old paper & make art of it. You can read about it here: http://xrl.us/oo2br',3,612,0,NULL,0,1,0,1,1,'2008-06-30 05:43:05','2010-02-01 19:51:09'),(627,101,52,'Dinosaur Pez','dinosaur-pez','In honor of  Dinosaur week - here are my dinosaur Pez dispensers',4,581,2,NULL,0,1,0,1,1,'2008-06-30 18:27:25','2010-02-01 22:17:55'),(628,62,654,'Star Wars','star-wars','Vintage Star Wars action figures along with anything else Star Wars that catches my eye!',11,530,5,NULL,0,1,0,1,1,'2008-07-01 10:48:18','2010-01-29 19:53:14'),(630,61,12,'Another Pez Collection!','another-pez-collection','I started consciously collecting Pez after I went to a Pez Convention in 2007. Since then, I\'ve just collected things I like!',28,939,2,NULL,0,1,0,1,1,'2009-09-13 00:20:51','2010-02-01 17:36:29'),(631,61,597,'East Coast West San Francisco','east-coast-west-san-francisco','You can find me and my Pez here in Oakland California\r\nhttp://bayareacollectibleshow.com/',1,349,0,NULL,0,1,0,1,1,'2008-07-02 11:14:52','2010-02-01 06:57:32'),(632,61,656,'FotoPaul\'s PEZ','fotopaul-s-pez','Some of FotoPaul\'s PEZ collection',12,599,0,NULL,0,1,0,1,1,'2008-07-02 16:25:49','2010-02-01 12:11:38'),(633,101,591,'CollectA ( Procon)','collecta-procon','New entry to the toy market. Procon revitalized the dinosaur toy line by releasing many species that were never seen before as toys/model. The figures are of various scale but are typically anywhere between 5\"-8\" long and 2\"-4\" tall. Great poses and some dramatic color schemes. I decided to dedicate an entire category just for the series since they really are spectacular! It\'s about time somebody made some unusual and obscure dinosaur species. The details are mix, some more than others. Overall, the figures look really cool. Plus the price is just right at around $5.00, the best value around! Check out the new line of dinosaur figures for 2008 that just got released, some really exciting and first ever figures. Procon really is putting the pressure on the other toy company to come up with more unusual dinosaur species. I can\'t wait to see what other dinosaurs Procon will release in the future!',48,2441,4,NULL,0,1,0,1,1,'2009-03-12 13:32:04','2010-02-01 18:16:50'),(634,61,90,'My pez, bit by bit','my-pez-bit-by-bit','later',65,740,0,NULL,0,1,0,1,1,'2008-07-04 22:24:16','2010-02-01 18:58:22'),(635,1,12,'Superman Action Figures','superman-action-figures','A small collection of various Supermen from various toy lines.',34,1218,1,NULL,0,1,0,1,1,'2008-07-05 22:50:39','2010-01-31 20:02:00'),(636,63,655,'Mattel Barbie Collection','mattel-barbie-collection','This is part of my fashion doll collection - the part that consists of all my fashion dolls made by Mattel, mostly in the Barbie line of dolls. ',35,1186,5,NULL,0,1,0,1,1,'2008-07-06 13:39:10','2010-02-01 21:56:00'),(637,101,52,'Dinosaur Models','dinosaur-models','These are some of my dinosaur models.',17,984,8,NULL,0,1,0,1,1,'2008-07-06 20:55:22','2010-02-01 12:12:22'),(638,6,59,'Paint By Numbers','paint-by-numbers','A small smattering of PBNs.  ',3,557,3,NULL,0,1,0,1,1,'2008-07-06 23:55:32','2010-01-31 17:57:54'),(640,63,625,'Barbie','barbie','Barbie and Family',21,626,0,NULL,0,1,0,1,1,'2008-07-08 15:35:47','2010-01-28 12:23:03'),(641,101,52,'Dinosaur Paint By Numbers','dinosaur-paint-by-numbers','I uploaded this one for Deanna - I enjoyed her articles about paint-by-numbers.',6,515,1,NULL,0,1,0,1,1,'2008-07-10 13:00:56','2010-01-29 23:40:27'),(642,1,12,'Wonder Woman Action Figures','wonder-woman-action-figures','A collection of figures of Wonder Woman.',20,1400,3,NULL,0,1,0,1,1,'2008-07-10 15:30:30','2010-01-29 14:47:55'),(643,6,644,'Wall art, paintings, pencil drawings','wall-art-paintings-pencil-drawings','I really like photo-realism. I also like surrealism. Many of our pieces combine the two.',44,510,3,NULL,0,1,0,1,1,'2008-07-10 16:18:10','2010-02-01 19:27:54'),(644,1,662,'Star Wars Clone trooper collection','star-wars-clone-trooper-collection','CLONE TROOPER FIGURES',NULL,79,0,NULL,0,1,0,1,1,'2008-07-10 20:07:17','2010-01-31 01:48:15'),(645,1,662,'Star Wars Collection','star-wars-collection','MY STAR WARS COLLECTION',NULL,83,0,NULL,0,1,0,1,1,'2008-07-10 20:12:42','2010-01-19 14:50:59'),(646,62,663,'Star Wars Lego minifigures','star-wars-lego-minifigures','Here are some of my sons Star Wars Lego he likes.',12,1431,0,NULL,0,1,0,1,1,'2008-07-10 23:57:05','2010-02-01 19:56:16'),(647,58,665,'Wine collection','wine-collection','California red wine',NULL,70,0,NULL,0,1,0,1,1,'2008-07-11 17:01:02','2010-01-18 05:10:29'),(648,101,591,'Japanese miniature dinosaur collection','japanese-miniature-dinosaur-collection','Since so many miniature dinosaur models come from Japan, I created a separate category for them. Most are highly detailed and comes unassembled. Kaiyodo, UHA, Yujin, and Sega are some of the company that produced miniature dinosaur figures. Very limited release in the USA making them very hard to find. ',42,842,3,NULL,0,1,0,1,1,'2009-03-22 16:13:36','2010-01-31 18:45:13'),(649,1,12,'Green Lantern Action Figures','green-lantern-action-figures','A collection of different characters in the Green Lantern Corps, at one time or another.',36,759,0,NULL,0,1,0,1,1,'2008-07-13 21:51:33','2010-02-01 11:39:45'),(650,101,591,'Safari figures','safari-figures','Safari Company is the premier US company when it comes to producing Museum Quality Dinosaur figures. It has one of of the largest line, so big that it warrants its own category. I don\'t have all of my Safari figures photographed. Safari also produces the Carnegie line, the Wild Safari line, Dinosaurs of China, and some prehistoric mammals. The Carnegie series is in conjunction with the Carnegie Museum; the figure are bigger. The Wild Safari line is smaller in size than the Carnegie but the figures are more colorful and the poses more dynamic. ',15,1106,0,NULL,0,1,0,1,1,'2008-07-13 21:52:24','2010-02-01 18:32:36'),(651,1,12,'Flash Action Figures','flash-action-figures','The Flash! Action figures! A lot of \'em!',16,752,0,NULL,0,1,0,1,1,'2008-07-13 21:53:58','2010-01-31 18:43:56'),(652,101,591,'Invicta ( BMNH) collection','invicta-bmnh-collection','The original scale model collection that set the standards that later toy manufacturers followed. Released in conjunction with the British Museum Of Natural History, the original figures line was a 1/45 scale and unpainted. Some species released later became standard like the Baryonx, but others like the Cetiosaurus, Megalosaurus, Muttaburrasaurus are still, as far as I know, only found in the series. Invicta, perhaps to compete with the emerging Safari line, release the same figures as a painted set. The painted versions are hard to find since it was only released for a short time. The paint is fragile, hard to find one that is without scratch/missing paint. My collection is 100% complete. The Troodon (Stenonychosaurus) is not at the same scale as the other dinosaurs, the figure was discontinued from production due to some copy right issues making it highly sought after and commanding Top $$$. The original unpainted figures were release in the 1970\'s. As far as I know, the entire line is now extinct. You can still find them on ebay at a reasonable cost.',62,1204,0,NULL,0,1,0,1,1,'2009-06-04 14:17:29','2010-02-01 10:06:10'),(654,67,668,'Baseball Memorabilia','baseball-memorabilia','==',17,835,0,NULL,0,1,0,1,1,'2008-07-14 15:37:55','2010-01-31 23:20:56'),(655,60,669,'jordans','jordans','js',6,337,0,NULL,0,1,0,1,1,'2008-07-14 17:24:32','2010-02-01 05:51:33'),(656,62,670,'my STAR WARS ','my-star-wars','my collection ranging from 1977 to 2008\r\n',358,834,1,NU