gn unimaginative and really boring. Salvat modified the heads of each figures, probably to avoid any copy right problems, other than that, the figures are remarkably close to the original ones. I found them on ebay. I could not find any more information about these curious line; I\'m not even entirely sure what country they originally are from. A few people in mentioned that some of the figures are available in South America as well.',28,1152,6,NULL,0,1,0,1,1,'2010-01-12 16:39:27','2010-02-01 12:42:01'),(748,101,52,'September 5th Weekend Haul','september-5th-weekend-haul','It was a good weekend for me and my dinosaur collection.  On Friday I received a box of dinosaur toys in the mail from my father in law (he knows I collect them and he buys them for me when he comes across them).  On Saturday I went to an estate sale that had some dinosaur toys.  And also on Saturday my wife was at a garage sale and found a huge box full of dinosaur toys!  On Sunday I returned to the estate sale to pick up some more dinosaur toys that I passed on the day before - they were half price on Sunday!  Total amount I spent for everything you see here: $13.50',51,725,9,NULL,0,1,0,1,1,'2008-09-07 10:29:28','2010-01-31 15:43:43'),(749,6,728,'My Art','my-art','Art I\'ve collected.',1,170,0,NULL,0,1,0,1,1,'2008-09-09 09:47:32','2010-01-14 04:19:18'),(750,67,112,'Take me out to the ballgame','take-me-out-to-the-ballgame','A collection of baseballs from around the league.',15,356,0,NULL,0,1,0,1,1,'2008-09-11 12:59:59','2010-01-28 11:26:47'),(751,67,672,'Complete Sets','complete-sets','1973, 87-91, 2000-08 Topps (05-08: Base Sets & Update Sets); 1987-91 Donruss; 1988, 90 Score; 1989-90 Fleer; 1990-91 Upper Deck; 2002 Bowman; 2005 Turkey Red; + more.',1,255,0,NULL,0,1,0,1,1,'2008-09-13 17:23:35','2010-01-28 18:39:03'),(752,285,730,'Diecast model collection','diecast-model-collection','Diecast models of American Muscle cars',54,399,0,NULL,0,1,0,1,1,'2008-09-14 10:12:28','2010-01-30 12:39:49'),(754