30'),(803,285,773,'My 1:18 scale car collection','my-1-18-scale-car-collection','I currently have 65 1:18 scale model cars. I started collecting in about 1997 and have been asking for a new model every Christmas and B-day. I slowed down on my collecting now since my family can\'t keep track of what I have and keep buying stuff I already have. Plus I\'m running out of room on my shelves with space for only about 4 more cars.',72,1039,4,NULL,0,1,0,1,1,'2009-03-26 18:09:16','2010-02-01 16:36:33'),(804,1,778,'DC Universe Action Figures','dc-universe-action-figures','Action figures of DC comic book characters.',96,1698,13,NULL,0,1,0,1,1,'2009-12-07 18:51:18','2010-02-01 20:43:58'),(805,54,591,'SEGA Dinoking figures (Japan)','sega-dinoking-figures-japan','New entry in the dinosaur toy figures market. I don\'t know much about these figures since they have never been released in the US ( although rumors has it it will soon be). The figures are based on the popular Dinosaur King video game. There are currently 36 figures. The figures are stylized in design. The colors are bright and fun but are inconsistent. Some figures are just plain solid colors ( the sauropods), reminds you of a bath toys, with minimal details, while others show more imaginative designs and details ( ceratopsians). The figures are articulated. Some really interesting species such as Saurolopus, Archelousaurus,Pachyrhyinosaurus,Futabasaurus,titanosaurus,Majungasaurus,Yangchuanosaurus to name a few. The figures are a close to the Schleich figures in size, but there is not set scale. Very much worth adding to any collection if you can get them. Definitely different from any other dinosaur figures.',26,3301,5,NULL,0,1,0,1,1,'2009-10-07 01:38:36','2010-02-01 21:10:47'),(806,779,781,'my power rangers collections/others','my-power-rangers-collections-others','this is my power rangers collection ive been collecting it since i was 9yrs old, ever since they came out is been 16yrs an im still doing it. at first when i was younger i use to open them but only for display now i dont even open them i keep them sealed that way they keep their value an if power rangers was expensive enough i started collecting marvel, transformers, star wars, and also beetleborgs till dis day i still keep getting everything that keep coming out but i dont open it i almost have everysingle thing there is out there right now i live in the US so i have half of my collection here and half back in my other house in puerto rico im hoping to put them to put them together to see how big is gona look till then i can only show u pics of them seperately.',42,723,1,NULL,0,1,0,1,1,'2008-10-27 13:45:07','2010-01-31 00:53:54'),(807,2,773,'Street Signs','street-signs','A collection of street signs that you probably pass in your daily driving',16,301,0,NULL,0,1,0,1,1,'2008-10-27 19:48:49','2010-01-30 00:59:48'),(808,54,775,'Jim\' Henson Muppets','jim-henson-muppets','Various Jim Henson\'s Muppets action figures by Palisades Toys (r.i.p.) and more',10,361,0,NULL,0,1,0,1,1,'2008-11-02 06:07:25','2010-01-30 11:38:26'),(809,54,782,'Gashapon','gashapon','Gashapon',NULL,93,0,NULL,0,1,0,1,1,'2008-11-02 10:15:52','2010-01-28 05:06:42'),(810,2,3,'The Smashing Pumpkins','the-smashing-pumpkins','Albums, singles, b-sides, rarities',2,204,0,NULL,0,1,0,1,1,'2008-11-06 10:21:16','2010-01-30 03:29:06'),(811,54,52,'Toys and Collectibles','toys-and-collectibles','In my quest to collect dinosaur toys sometimes I come across other cool toys that I do not have room to store, so I must sell them!  And sometimes I even sell dinosaur toys too!',7,487,0,NULL,0,1,0,1,1,'2008-11-07 10:53:09','2010-02-01 18:41:23'),(812,491,59,'Travel & Tourism','travel-tourism','Postcards, maps, travel brochures, and other assorted ephemera.',26,636,1,NULL,0,1,0,1,1,'2008-11-09 05:09:59','2010-01-31 10:23:05'),(813,12,59,'Chalkware & Plaster','chalkware-plaster','Vintage chalkware, retro plaster; figurines, wall plaques.  See my article here at Collectors\' 