my collection of force unleashed figures all moc',2,75,0,NULL,0,1,0,1,1,'2009-01-14 09:46:47','2010-01-23 22:40:44'),(957,1,719,'star wars expanded universe','star-wars-expanded-universe','my collection of expanded universe figures from 1998 all moc',3,275,0,NULL,0,1,0,1,1,'2009-01-14 10:17:25','2010-02-01 16:41:37'),(958,1,719,'power of the force 1995-2000','power-of-the-force-1995-2000','my collection of power of the force figures from 1995 -2000 all moc',45,337,0,NULL,0,1,0,1,1,'2009-01-14 10:24:28','2010-01-30 00:36:27'),(959,1,719,'star wars shadows of the empire figure collection','star-wars-shadows-of-the-empire-figure-collection','my collection of figures from the shadows of the empire range all moc from 1996',6,380,0,NULL,0,1,0,1,1,'2009-01-14 13:33:22','2010-02-01 10:44:36'),(960,1,719,'star wars power of the jedi action figures','star-wars-power-of-the-jedi-action-figures','my collection of potj figures 200/2002',3,357,0,NULL,0,1,0,1,1,'2009-01-14 13:49:12','2010-01-28 11:50:27'),(961,1,719,'the phantom menace action figures','the-phantom-menace-action-figures','star wars episode 1   1999-2001\r\nin 1999 a long awaited dream came true for star wars fans when episde 1:the phantom menace was released. after more then 20 years, the story of the fall of the republic and the destruction of the jedi knights commenced. the movie dealt with the final adventure of jedi master qui-gon jinn and his padawan, obi-wan kenobi and revealed the first moves of the sith infiltrator at the heart of the republic. new characters had to be created, since the movie takes place at a time before most of the popular heroe were born.\r\n\r\nThree years in the making allowed the producers to come up with a great marketing concept; regular household items such as mugs or towels were upgraded to collectables. The toy stores introduced new items that were of interest to small and big kids alike.\r\n\r\nthe frenzy began two weeks before the official start of the movie in the USA. On may 3rd 1999,  many big department stores opened their doors at midnight to present fans with the new series of collectablesw; sales were huge and ran into the millions. thanks to the internet, the new toys were offered to collectors around the world immediately and were sold on for prices much higher then those in the store.',3,396,0,NULL,0,1,0,1,1,'2009-01-14 14:14:24','2010-01-30 21:22:38'),(962,1,719,'revenge of the sith action figures','revenge-of-the-sith-action-figures','my collection of rots figures',18,395,0,NULL,0,1,0,1,1,'2009-01-14 14:34:34','2010-01-30 11:11:34'),(963,1,719,'star wars saga collection 2002-2004','star-wars-saga-collection-2002-2004','my collection of sws figures',10,532,0,NULL,0,1,0,1,1,'2009-01-14 15:00:50','2010-02-01 22:29:54'),(964,756,910,'Vintage Lingerie','vintage-lingerie','My collection, past and present of my favorite pieces of vintage lingerie. vintage nightgowns, vintage peignoir sets.',16,1287,7,NULL,0,1,0,1,1,'2009-01-15 23:13:37','2010-02-01 23:52:30'),(965,2,910,'Vintage Lingerie Vanity Fair Advertisements','vintage-lingerie-vanity-fair-advertisements','Vast collection of vintage nightgown advertisements from Vanity Fair.',10,557,1,NULL,0,1,0,1,1,'2009-01-15 23:40:53','2010-02-01 08:11:16'),(966,65,911,'Pandamonium','pandamonium','Pandas are the future.',16,140,0,NULL,0,1,0,1,0,'2009-01-16 11:48:38','2010-01-30 11:22:32'),(967,184,912,'Syracuse, NY Breweriana','syracuse-ny-breweriana','Some items from my collection of Syracuse, NY Breweriana',52,517,2,NULL,0,1,0,1,0,'2009-02-24 10:47:09','2010-01-31 09:31:04'),(968,184,915,'Busch Mountains','busch-mountains','Busch Mountains contains over 50,000 empty cans of Busch Beer. The Busch Brothers created this monument to Busch Beer. Busch Mountains is located across from the University of Cincinnati, in Ohio. The Busch Brothers started as a group in 1984, with just a few original members. These founding Busch Brothers created the greatest organization of all time. In 1992 they moved into the house known as The Mountains. The house was built in the late 1800s with 7 total bedrooms. As of 1992 the Busch Brothers had only collected 2,400 empty cans of Busch Beer. 1,200 cans were consumed and saved before 1987 and another 1,200 Busch Beer Cans were accumulated in the next 5 years. Then the Busch Brothers moved into The Mountains where drinking used to take place on a daily basis. Over the next 5 years the consumption was about 4,000 cans a year. Our group now includes many full members, some associate members and some honorary members. the Busch Brothers had over 50,000 Busch Beer cans. At one point the cans had taken up so much space that the Mountains had expanded to include the walls in the house next door. The goal was to have the world record for most cans of a single kind of beer in one collection. All of these cans of Busch Beer were consumed by our members or our thousands of guests over the years.',15,274,3,NULL,0,1,0,1,1,'2009-01-16 16:03:54','2010-01-27 15:26:14'),(969,184,916,'Beer Napkins','beer-napkins','Beer napkins have been around for many years but are hard to come by because they were meant to be disposable.  There are some beautiful napkins with great artwork out there.',9,450,1,NULL,0,1,0,1,1,'2009-01-16 16:51:12','2010-01-30 23:46:59'),(970,245,909,'Ancient Roman Bronze Coins','ancient-roman-bronze-coins','Bronze coins of the Roman Empire',18,381,2,NULL,0,1,0,1,1,'2009-01-16 19:56:49','2010-02-01 18:14:06'),(972,758,917,'My Diecast Room','my-diecast-room-1','This is what nearly 6,000 Hot Wheels look like on display.  The non-Hot Wheels (with a few exceptions) are displayed in the garage',15,264,5,NULL,0,1,0,1,1,'2009-01-16 20:27:26','2010-01-30 03:51:09'),(973,184,920,'Narragansett Beer','narragansett-beer','This is a complete listing of my entire collection of Narragansett Brewing Company beer bottles.',21,751,8,NULL,0,1,0,1,1,'2009-02-23 17:07:41','2010-02-01 18:34:22'),(974,755,922,'Blaction- Black Action Figures','blaction-black-action-figures','I have been collecting black action figures for the past 15 years, or so---all because there were so few growing up. One can only \"be\" Lando so many times. It started out as a joke, then became a challenging thing that friends would purchase for holidays....now, I am proud of the collection, and frequently seek out the most ridiculous, most obscure, or funniest figures which will enhance the collection. I welcome suggestions or leads.  Thanks to my ole lady Kristy, Sharon, Marc, Sis, Mom, Adam, Eugene, Pete, Jo, and everyone else who has gifted my fancy ass over the years. ',136,1826,13,NULL,0,1,0,1,1,'2009-01-19 02:28:06','2010-02-01 20:25:51'),(975,424,923,'Maps, and Around the world program books.','maps-and-around-the-world-program-books','Maps, and Around the world program books.',NULL,53,0,NULL,0,1,0,1,1,'2009-01-19 11:38:40','2010-01-29 09:21:47'),(976,424,923,'Old maps.','old-maps','I like to collect old maps and enjoy autonomous regions of the world',NULL,54,0,NULL,0,1,0,1,1,'2009-01-19 12:10:48','2010-01-30 06:07:16'),(977,756,925,'Pinup Girls','pinup-girls','This is a collection of Pinup girl paintings I\'ve collected',16,1838,7,NULL,0,1,0,1,1,'2009-01-19 15:09:48','2010-02-01 15:02:08'),(978,245,926,'lebanese coins','lebanese-coins','My sheets of coins',21,712,52,NULL,0,1,0,1,1,'2009-01-19 16:39:28','2010-02-01 21:54:14'),(979,65,927,'pandas','pandas','pandas are cool',NULL,35,0,NULL,0,1,0,0,0,'2009-01-19 16:43:57','2010-01-25 06:45:12'),(982,184,928,'Brian\'s Breweriana Collection','brian-s-breweriana-collection','A sampling of the beer advertising items and breweriana out of my collection.  Some uncommon to rare and some are just my favorites.',44,878,10,NULL,0,1,0,1,1,'2009-02-12 22:26:04','2010-02-01 19:51:11'),(983,313,929,'Fantasy Stuff','fantasy-stuff','all my fantasy stuff',6,202,0,NULL,0,1,0,1,1,'2009-01-20 16:46:48','2010-01-29 22:14:27'),(984,243,909,'Ancient Roman Silver coins','ancient-roman-silver-coins','Sliver coins of the Ancient Roman Empire',6,149,0,NULL,0,1,0,1,1,'2009-01-20 20:02:09','2010-01-28 12:20:20'),(985,184,931,'Sports Cans Collection','sports-cans-collection','Sports can collections',17,346,3,NULL,0,1,0,1,1,'2009-01-21 16:15:55','2010-02-01 18:33:50'),(986,1,932,'Action Figures','action-figures-2','An eclectic collection of figures.',22,270,6,NULL,0,1,0,1,1,'2009-01-21 18:12:35','2010-02-01 17:48:28'),(987,17,933,'Silver Screen Vintage Lingerie','silver-screen-vintage-lingerie','The most heavenly vintage lingerie in the world.',NULL,32,0,NULL,0,1,0,1,0,'2009-01-21 21:41:09','2009-12-11 21:05:31'),(988,54,889,'The theropod collection','the-theropod-collection','I can\'t deny it, when it comes to dinos, the theropods are my favorite kind. Long, sharp teeth, puny arms and strong legs appeal to me :D',50,515,2,NULL,0,1,0,1,1,'2009-10-19 00:53:32','2010-01-31 12:30:11'),(989,5,937,'mourning pendant','mourning-pendant','Mourning pendant depicting woman mourning by urn memorial with Cath. Gilbert died at 48 1776. dedication to a loving mother around edge of piece. Glass intact. Gold casing. Piece related to the family of Sir Humphrey Gilbert, a relative of Sir Walter Raleigh',NULL,44,0,NULL,0,1,0,1,1,'2009-01-23 14:51:02','2010-01-14 21:25:20'),(990,65,939,'camels','camels','all kinds of depictions of camels',NULL,48,0,NULL,0,1,0,1,1,'2009-01-24 05:00:44','2010-01-25 08:02:19'),(991,1,794,'TRANSFORMERS beasts','transformers-beasts','what is limitless in life, outer space, numbers, and the imagination.  when beast wars came out, i was not a fan of the whole idea.  the ideas in names, characters, and design caught on with all of us that collect this group, and now I can\'t get enough of them.',12,492,0,NULL,0,1,0,1,1,'2009-01-24 09:55:25','2010-02-01 11:39:56'),(992,240,939,'neckties','neckties','neckties. the uglier the better.',NULL,57,0,NULL,0,1,0,1,1,'2009-01-24 16:21:12','2010-01-14 00:24:14'),(996,765,940,'Some of My Favorite McCoy Cookie Jars','some-of-my-favorite-mccoy-cookie-jars','These are just a few of my favorite McCoy cookie jars.  The subjects range from animals to space motifs to Fruits & Veggies to Sports and beyond!   Some of the McCoy jars were made in the Forties, a couple in the Thirties but many, many of them came along in the Fifties and Sixties and later.  These photos show only part of the ones manufactured by McCoy Pottery.  I do have some in my collection that were made by Brush, RRpco , American Bisque and a few miscellaneous ones.  There\'s nothing quite like the excitement of spotting a jar you\'re looking for!  PLEASE EXCUSE THE DUST!  I\'d rather be out hunting than staying home dusting!\r\n\r\n\r\nI enjoy talking to other collectors of McCoy and helping them with questions they may have.  Reproductions and fakes are such a problem in todays collecting world that  I try to help educate others through my site and the McCoy Pottery Collectors Society site. \r\n\r\n\r\nMy hobby of collecting McCoy has netted me many friends who share the same interest.  Through the hobby I\'ve been able to contribute to some of the collector books and even appeared on Martha Stewart several years ago with some of the McCoy Cookie Jars. ',38,1279,10,NULL,0,1,0,1,1,'2009-01-24 21:36:34','2010-02-01 14:43:27'),(997,551,940,'McCoy Planters & Favorite Pieces','mccoy-planters-favorite-pieces','McCoy Pottery made many different things for many years.  As well as the cookie jars I\'ve collected anything else McCoy.  Here will be a few of my favorites from the collection.',3,315,0,NULL,0,1,0,1,1,'2009-01-25 15:47:24','2010-02-01 09:19:14'),(998,44,936,'My Purses','my-purses','Different types, sizes and color\'s of my designer purses',13,198,0,NULL,0,1,0,1,1,'2009-01-27 12:21:02','2010-02-01 14:55:12'),(999,758,946,'My HW Collection','my-hw-collection','I have been collecting for about 5 years and I now have 1,100+ cars in my collection. Every month I get about 20 or 30 more. I generally collect mainlines but I will buy limite