ies 3 Dinos in color changing as in series 2. Total 12.\r\n\r\nThe complete set totals 64.\r\n\r\nI only need 4 more for the complete set. If anyone has any of these, I am interested in trading or buying. I have many extras and will even trade 2 or 3 for 1 that I need.',13,524,1,NULL,0,1,0,1,1,'2009-10-02 19:10:51','2010-02-01 12:38:58'),(1059,54,591,'Metal Dinosaur figures','metal-dinosaur-figures','There are many metal figures out. I don\'t actively collect them, but I do have a few.\r\nI\'m mostly interested in the SRG figures and some of the hard to find prehistoric mammals.',20,428,0,NULL,0,1,0,1,1,'2009-05-04 23:19:12','2010-02-01 09:21:30'),(1061,25,992,'Vintage Plastic Brooch','vintage-plastic-brooch','Vintage Plastic Brooch\r\n\r\nA vibrant whimsical vintage Plastic brooch figural depicting a stylish woman strumming a guitar.\r\n\r\nFor complete detail visit Old Luxe, Antiques and Collectibles.  Thank you for looking!\r\n\r\nVintage Plastic Brooch',1,106,0,NULL,0,1,0,0,0,'2009-02-22 14:17:08','2010-01-30 02:54:37'),(1062,377,992,'Prince Charles and Lady Diana Mug','prince-charles-and-lady-diana-mug','Prince Charles and Lady Diana Mug\r\n\r\nA fine bone china mug by Crown Staffordshire England for the wedding of Prince Charles and Lady Diana Spencer Oval portraits with flowers of the union around and a crown above See all photographs Excellent condition.\r\n\r\nFor complete details visit: Old Luxe, Antiques and Collectibles.  Thank you for looking!\r\n\r\nPrince Charles and Lady Diana Mug',1,516,0,NULL,0,1,0,0,0,'2009-02-22 14:36:57','2010-02-01 10:50:32'),(1063,54,591,'Papo','papo','Papo of France. They released a series of highly detailed dinosaur figures based on the JP movies. Almost all of the figures they released have been seen in the movies except the mammoth and the allosaurus. Very well made, the details are amazing! Some of the predators have even movable jaws! To date, they released eight figures.',12,582,3,NULL,0,1,0,1,1,'2009-02-22 19:40:47','2