s are by David Smith. It\'s my goal to have one each of his designs!',3,179,2,NULL,0,1,0,1,1,'2009-03-13 17:51:58','2010-02-01 03:06:02'),(1138,235,1070,'Skeleton clocks ','skeleton-clocks-2','Skeleton clocks are designed to show the clock mechanism which is usually hidden inside a conventional clock case. Therefor, the movement is finished in a decorative style with high quality finishes. Most of the clocks in my collection contain some unusual feature or mechanical complication like a remontoire (check my web site for more detail), special escapement or visual style. I have commissioned a very large and complex skeleton clock that will be one of the most complex made in the past 100 years. It will have about 300 wheels, 600 jewelled bearings and over 10,000 parts. More on my website at: www.my-time-machines.net.  You will also find my collection of tower clocks there, a very large version of the skeleton clock. The clock featured in the recent Oscar nominated movie \"The Curious Case of Benjamin Button\" is there, Paramount Studios rented this clock for the movie.',24,503,4,NULL,0,1,0,1,1,'2009-03-16 13:42:35','2010-01-31 02:40:25'),(1139,269,1085,'eggs','eggs','collector eggs',13,371,2,NULL,0,1,0,1,1,'2009-03-18 10:51:40','2010-01-31 16:10:57'),(1140,5,1086,'mcdoalds lego antique','mcdoalds-lego-antique','mcdoalds lego from 1960s ',NULL,45,0,NULL,0,1,0,1,1,'2009-03-14 17:34:14','2010-01-24 12:39:10'),(1141,677,1088,'mcdonalds toys','mcdonalds-toys','mighty dinos',NULL,26,0,NULL,0,1,0,1,1,'2009-03-14 21:40:32','2010-01-19 10:45:19'),(1142,164,1088,'beanie babies','beanie-babies-2','some original beanies, some mcdonalds beanies',NULL,34,0,NULL,0,1,0,1,1,'2009-03-14 22:12:49','2010-01-31 04:26:41'),(1143,491,59,'Vintage & Retro Booklets & Such','vintage-retro-booklets-such','Old booklets, brochures, catalogs etc.',14,343,3,NULL,0,1,0,1,1,'2009-08-31 23:22:56','2010-02-01 17:20:44'),(1144,491,59,'Vintage Greeting Cards','vintage-greeting-cards','Assorted antique, vin