\nThese pinup prints are old and original.\r\n\r\nMy item number pinup21',8,774,NULL,NULL,0,1,0,1,1,'2009-04-30 13:41:51','2010-02-01 06:57:10'),(1283,760,1178,'Magnetic Appeal','magnetic-appeal-1','This is just a small sampling of my collection, but also some of my favorites!!',52,146,2,NULL,0,1,0,1,1,'2009-04-30 16:47:50','2010-01-28 07:40:03'),(1284,491,1197,'Vintage Sheet Music','vintage-sheet-music-1','Collection of vintage Sheet Music many different songs',24,266,1,NULL,0,1,0,1,1,'2009-04-30 18:28:00','2010-02-01 04:40:18'),(1285,61,847,'PEZ\'d Off','pez-d-off','Once upon a time, I was fascinated by these plastic thingamajigs.',55,213,NULL,NULL,0,1,0,1,1,'2009-06-10 10:08:24','2010-01-30 03:48:49'),(1286,370,1202,'Vintage Pyrex','vintage-pyrex','My collection of vintage Pyrex bakeware.  I collect all different pieces including casseroles, bowls, and refrigerator dishes.  My favorite patterns are Friendship, Butterprint, Square Flowers, Stem, and Town & Country',23,273,2,NULL,0,1,0,1,1,'2009-05-01 21:43:46','2010-01-29 15:10:14'),(1287,30,1201,'Jasons Collecting Room','jasons-collecting-room','My collection of WWII militaria and collectibles on display in my War Room.',21,269,1,NULL,0,1,0,1,1,'2009-05-02 20:36:01','2010-02-01 13:38:44'),(1288,760,978,'Political Magnets','political-magnets','Commerically-available or campaign-distributed political magnets.  One is homemade--the round sticker with the Obama image was placed on a round magnet for use on a car and now a fridge.  Some magnets are pinless political button-type items with a magnet that the manufacturer put in place.  Earliest magnet was from then-Governor Bill Clinton\'s inaugural ball in 1991.  ',38,191,1,NULL,0,1,0,1,1,'2009-05-02 21:05:24','2010-01-31 06:10:34'),(1289,760,1190,'My Vast Refrigerator Magnet Collection','my-vast-refrigerator-magnet-collection','This is a collection of magnets from the different places I have traveled to.',31,248,2,NULL,0,1,0,1,1,'2009-05-06 17:02:58','2010-01-31 20:23:06'),(1290,330,1212,'The Museum UnCut Funk Movie Poster  Collection','the-museum-uncut-funk-movie-poster-collection','The collection includes a small sample of Italian movie posters from the 1970\'s Blaxploitation film genre. To view the entire collection of The Museum of Uncut Funk please visit www.museumofuncutfunk.com',10,296,NULL,NULL,0,1,0,1,1,'2009-05-03 19:28:40','2010-01-31 19:50:06'),(1292,403,1213,'Julie Bell Knives in collector tins','julie-bell-knives-in-collector-tins','I LOVE Julie Bell\'s work. The tins are in perfect condition and the blades are like new. Including the hilt they are 7in long.',7,115,NULL,NULL,0,1,0,1,1,'2009-05-03 22:28:05','2010-01-30 21:13:29'),(1293,2,1213,'Art By Kyra Moon','art-by-kyra-moon','The many pieces of art that I have',15,146,NULL,NULL,0,1,0,1,1,'2009-05-03 23:10:10','2010-02-01 19:45:56'),(1294,766,1214,'my horror figures collection','my-horror-figures-collection','priceless',37,351,1,NULL,0,1,0,1,1,'2009-05-04 07:08:41','2010-01-31 23:34:33'),(1295,26,1216,'The Home Gnome\'s Kitchen','the-home-gnome-s-kitchen','Some of the beautiful pieces in our found collection',40,158,5,NULL,0,1,0,1,1,'2009-05-12 16:36:20','2010-01-28 11:58:55'),(1296,61,1218,'pez','pez-8','all kinds',NULL,21,NULL,NULL,0,1,0,1,1,'2009-05-04 16:38:40','2010-01-17 01:52:56'),(1297,240,1216,'Vintage Styles for Men and Women','vintage-styles-for-men-and-women','Take a look at some of the sassy, elegant, chic, lacy, filmy, manly and rockabilly clothes we have to offer',20,184,2,NULL,0,1,0,1,1,'2009-05-04 17:31:06','2010-01-30 01:52:54'),(1298,370,1219,'Vintage Pyrex','vintage-pyrex-1','Colorful Pyrex from the 1950s to 1970s.',15,253,3,NULL,0,1,0,1,1,'2009-05-04 18:54:30','2010-01-28 10:19:17'),(1299,115,1212,'Black Animation','black-animation','The Museum of UnCut Funk Collection includes original production drawings and cels and limited edition cels from the 1970s,1980s and 1990s. Please visit The Museum of UnCut Funk to see more of our collection of Black animation and read our animation blogs.',3,191,2,NULL,0,1,0,1,1,'2009-05-04 20:07:13','2010-02-01 09:32:03'),(1300,250,1212,'Black Comic Books and Graphic Novels','black-comic-books-and-graphic-novels','The Museum of UnCut Funk Collection includes Luke Cage, Storm and other comic books from the 1960s, 1970s and early 1980s. Please visit to see more of our collection at The Museum of UnCut Funk. www.museumofuncutfunk.com',3,272,1,NULL,0,1,0,1,1,'2009-05-04 20:24:47','2010-01-31 20:04:15'),(1301,52,1212,'Blacks on Stamps ','blacks-on-stamps','The Museum of UnCut Funk Collection includes The Black Heritage Series from the USPS and other stamps featuring Blacks on them. Please visit The Museum of UnCut Funk to read our stamp collecting blog.',1,78,NULL,NULL,0,1,0,1,1,'2009-05-04 20:59:35','2010-01-20 19:04:57'),(1302,15,1212,'Blacks on Currency and Gold Medals','blacks-on-currency-and-gold-medals','The Museum of UnCut Funk Collection includes a collection of gold coin and medal featuring Blacks. Please visit The Museum of UnCut Funk at www.museumofuncutfunk.com to read our blogs about our collection. ',6,154,NULL,NULL,0,1,0,1,1,'2009-05-04 20:46:56','2010-02-01 14:01:38'),(1303,30,1201,'For Sale','for-sale','ww2 militaria for sale, German and American pieces.',9,205,3,NULL,0,1,0,1,1,'2009-05-28 14:09:05','2010-02-01 05:19:02'),(1304,613,1216,'Vintage Yardage','vintage-yardage','Some of the lovely textiles that have been languishing in my attic',16,183,NULL,NULL,0,1,0,1,1,'2009-05-04 23:22:31','2010-01-30 22:58:46'),(1305,677,591,'Kleinwelka Dinosaurs','kleinwelka-dinosaurs','I don\'t know much about this line. They are from Germany. I believe they are made for this park that showcase prehistoric life sculptures.\r\nThe figures are big, bigger than I thought. They look like a cross between the old Marx and Invicta figures. The sculpt is very retro looking.\r\nI\'m not sure how many figures are there in the line.',7,343,1,NULL,0,1,0,1,1,'2009-05-04 23:43:58','2010-01-30 07:16:11'),(1306,258,591,' Dinosaur Toy Forum Prehistoric Figures','dinosaur-toy-forum-prehistoric-figures','This line of prehistoric animal figures are developed  in collaboration with members of the Dinosaur Toy Forum. Sculpted by Malcolm, each figure is truly unique. It\'s a one man productions, from concept, sculpting,molding, casting, and painting. They are not toys, but intended for collectors. The pose are very dynamic and very active, and scientifically accurate.\r\nThe price are very reasonable, unlike other desktop figures. If you are interested in any of the figures, you can join or visit the Dinosaur Toy Forum and see the entire line. You can contact the artist directly or see his ad on the latest issue of Prehistoric Times magazine #89. Or I can get in touch with him.',25,4397,23,NULL,0,1,0,1,1,'2009-08-26 14:35:05','2010-02-01 20:02:58'),(1307,370,1200,'Diagnosising \'Pyrexia\' Affliction','diagnosising-pyrexia-affliction','A photographic exploration of one girls love for Vintage Pyrex!',24,308,3,NULL,0,1,0,1,1,'2009-06-10 13:16:50','2010-01-31 19:07:09'),(1308,26,1221,'Vintage Kitchen ','vintage-kitchen','pictures of things in my vintage kitchen ',63,263,NULL,NULL,0,1,0,1,1,'2009-06-29 20:16:21','2010-01-30 10:50:09'),(1309,392,1226,'Plastic Christmas Blow Molds','plastic-christmas-blow-molds','This is my 1990 Union Products Snowlady. She is Union catalog #7678. Manufacturing date is 1990.',1,331,1,NULL,0,1,0,1,1,'2009-05-07 04:13:26','2010-01-28 12:11:40'),(1311,677,1228,'Re-ment Miniature','re-ment-miniature','http://stores.shop.ebay.com/Japan-Toys-Collection-Online-Store__W0QQ_armrsZ1',NULL,30,NULL,NULL,0,1,0,0,1,'2009-05-08 09:45:29','2009-12-31 10:39:12'),(1312,677,1228,'Disney Go Go Market Supermarket Full Set','disney-go-go-market-supermarket-full-set','      Size: Approx. 1-2 inch small size (miniature) \r\n      Material: Plastic \r\n      Re-ment 2009 original product. \r\n      100% brand new. Never been used.\r\n \r\n',NULL,35,NULL,NULL,0,1,0,0,1,'2009-05-08 10:07:24','2010-01-14 08:32:21'),(1313,335,1223,'Camera Collage Art','camera-collage-art','I am so inspired by vintage camera and photography ephemera!  I love creating \"creatures\" from inanimate objects.',15,195,NULL,NULL,0,1,0,1,1,'2009-05-08 12:15:00','2010-01-28 12:15:01'),(1314,335,1223,'Femme Dada','femme-dada','This collection of collages are what I like to call femme dada.  Of all all the Dada artists, I am most inspired by Hannah Hoch and Max Ernst.',15,239,NULL,NULL,0,1,0,1,1,'2009-05-08 12:29:05','2010-02-01 19:50:40'),(1315,2,591,'Armored Dinosaurs','armored-dinosaurs','They are built like a tank, ready for battle! The Stegosaurs and Anklylosaurs have body armor of spikes, clubs, and plates! Both groups are standard figures in the toy market. Almost all of the major toy line have at least one version if not two. There are countless cheap figures out. ',17,343,2,NULL,0,1,0,1,1,'2009-05-23 15:49:13','2010-01-31 16:29:15'),(1316,6,1223,'Femme Fatale Collages','femme-fatale-collages','This collection is of my \"lingerie collages\" some have sold, some still available.  Several exhibited at a show in Manchester, UK',13,286,NULL,NULL,0,1,0,1,1,'2009-05-08 21:41:23','2010-01-30 11:45:53'),(1318,26,1231,'Cookie Cutters','cookie-cutters-1','Cookie cutters, cookie cutters, cookie cutters!!',7,170,NULL,NULL,0,1,0,1,1,'2009-05-11 12:07:34','2010-02-01 17:09:54'),(1319,2,1223,'Women Alone','women-alone','These are images of my paintings, some done with gouache, some watercolor.  ',15,174,NULL,NULL,0,1,0,1,1,'2009-05-10 12:35:40','2010-01-30 06:52:01'),(1320,780,1200,'Coffee Cups with Other Peoples Names','coffee-cups-with-other-peoples-names','My collection of Coffee cups with other peoples names.... it was a friend of mines idea, not sure where this collection is going necessarily, but it always excites me to find a new mug!',38,259,2,NULL,0,1,0,1,1,'2009-05-10 13:03:52','2010-01-30 17:34:35'),(1321,370,1233,'Pyrex Dish Collection','pyrex-dish-collection','I try to stick mainly to Aqua colored items, but I can\'t resist picking up unusual / rare patterns or any inexpensive 401 bowls. My favorite item is my complete set of Aqua mixing bowls.',16,322,5,NULL,0,1,0,1,1,'2009-05-18 00:33:17','2010-02-01 20:15:14'),(1322,26,1233,'Non-Pyrex Collection','non-pyrex-collection','Fire King, GlasBake and Hazel Atlas collection.',9,215,NULL,NULL,0,1,0,1,1,'2009-05-14 15:22:40','2010-02-01 07:45:37'),(1323,26,1207,'Antique toasters from 1910 - 1960','antique-toasters-from-1910-1960','Examples of appliances with color from these two major manufacturers .. late 1940s Kenmores on top shelf, mid 1950s Westinghouse on lower row. These are all automatic pop-up models.',8,1156,17,NULL,0,1,0,1,0,'2009-05-10 23:42:15','2010-02-01 23:22:14'),(1324,26,1196,'Vintage Cookbooks','vintage-cookbooks-1','Here\'s some of the best of the titles featured on the blog http://vintagecookbooks.blogspot.com and also some of my hidden stashes around the house...',13,176,2,NULL,0,1,0,1,0,'2009-05-10 21:44:45','2010-01-30 00:37:57'),(1325,26,1207,'Toasters: Delta Pop-down, 1910 GE D12, E9410 LF&C','toasters-delta-pop-down-1910-ge-d12-e9410-lf-c','This is a dropper style toaster, so called because the bread drops out the bottom once it is toasted. Each piece drops to the opposite lower side of the unit. It was manufactured by the Delta Mfg Co of Philadelphia, PA, in the late 1930s-1940s.',1,150,NULL,NULL,0,1,0,1,0,'2009-05-11 01:15:52','2010-02-01 16:03:26'),(1326,26,1233,'Everything Else Kitchen','everything-else-kitchen','Other random vintage kitchen items I\'ve gotten from here or there.',14,290,4,NULL,0,1,0,1,1,'2009-05-18 00:36:21','2010-01-31 01:04:01'),(1327,26,1238,'My Fiesta ','my-fiesta','I always have an ever changing display or two of Fiesta in my home.  I don\'t save any of it for \"good\", but use it all when I can.  I love that I can use it to decorate for the seasons by the colors of dishes.  I especially love the bright colored ones!',26,235,1,NULL,0,1,0,1,1,'2009-07-01 21:26:14','2010-01-30 18:33:45'),(1328,767,1239,'Soviet and Russian Camera Collection','soviet-and-russian-camera-collection','This is 2 years of effort searching the globe for rare examples of Soviet and Russian cameras.  I hope you enjoy it.',38,280,3,NULL,0,1,0,1,1,'2009-05-12 13:22:13','2010-02-01 06:57:11'),(1329,767,1240,'RalM. Camera Collection','raulm-camera-collection','This is the best part of my camera collection. I\'m particularly interested in folders from the \'50 as well as FSU cameras, any, German cameras, mainly Voigtlander and SLR Nikon, cameras and lenses. All the others are welcome if the price is right.',17,261,NULL,NULL,0,1,0,0,0,'2009-05-12 18:57:48','2010-01-31 13:35:21'),(1330,330,1153,'Return of the Living Dead (Part 1, original)','return-of-the-living-dead-part-1-original','This will be The Return of the Living Dead only.',4,208,NULL,NULL,0,1,0,1,1,'2009-05-12 16:40:23','2010-01-31 23:27:35'),(1331,330,1153,'Dawn of the Dead (Romero\'s)','dawn-of-the-dead-romero-s','This is only Dawn of the Dead ',2,73,NULL,NULL,0,1,0,1,1,'2009-05-12 16:15:45','2010-01-27 03:16:13'),(1332,330,1153,'Day of the Dead (Romero\'s)','day-of-the-dead-romero-s','This is Day of the Dead only',3,190,NULL,NULL,0,1,0,1,1,'2009-05-12 16:49:24','2010-01-30 11:37:16'),(1333,330,1153,'Night of the Living Dead (1968 and 1990)','night-of-the-living-dead-1968-and-1990','This is for the Night of the Living Dead film',2,68,NULL,NULL,0,1,0,1,1,'2009-05-12 15:59:48','2010-01-31 00:39:32'),(1334,470,1237,'TBF Avenger crash landed at sea','tbf-avenger-crash-landed-at-sea','I made the water out of celluclay and resin',NULL,27,NULL,NULL,0,1,0,1,1,'2009-05-12 19:51:26','2010-01-23 12:46:40'),(1335,30,1237,'Military Model Collection','military-model-collection','These are all models i have built over the years, many have won awards, and some are on display at Museums.',16,398,2,NULL,0,1,0,1,1,'2009-05-12 20:13:48','2010-01-31 00:08:35'),(1336,767,1242,'Brownie Hawkeye','brownie-hawkeye','the prize of my collection because it used to be my late grandfathers camera. When he passed away it was given to me and it was my first older camera that I could not use. This is the camera that started it all. I love old things and since my passion is photography it was only a matter of time for me to collect these fine machines!',3,112,NULL,NULL,0,1,0,1,1,'2009-05-13 16:17:06','2010-02-01 07:35:06'),(1337,30,1243,'German WWII','german-wwii','German WWII collection mostly repo.',14,287,3,NULL,0,1,0,1,1,'2009-05-13 20:40:02','2010-01-29 18:41:08'),(1339,301,1191,'Miniatures','miniatures-2','I collect mostly kitchen related miniatures, often of things I use in my own kitchen. Most of my collection consists of Re-ment items because I find they are so detail oriented. Occassionally miniature versions of other things in my home make their way into my collection.',6,152,1,NULL,0,1,0,1,1,'2009-05-14 16:01:33','2010-01-30 02:55:38'),(1340,764,1229,'The Lion King/Lion King on Broadway Collection','the-lion-king-lion-king-on-broadway-collection','This is (most of) my collection from The Lion King and The Lion King on Broadway, consisting of 890 pieces of merchandise/memorabilia as of May 15, 2009.  I\'ve been collecting since late 2003 and I believe I may have have one of the largest and diverse TLK collections in the world. \r\n\r\nPlease visit my profile to learn more about how I got into The Lion King and collecting, but for now enjoy my award-winning collection, somewhat organized through collage pictures of items belonging to similar categories.',21,753,34,NULL,0,1,0,1,1,'2009-05-14 22:16:24','2010-02-01 22:36:13'),(1341,37,1246,'Film cameras and lenses','film-cameras-and-lenses','Film cameras and lenses',NULL,33,NULL,NULL,0,1,0,1,1,'2009-05-15 03:54:21','2010-01-20 04:22:21'),(1342,26,1249,'Stoves through the years','stoves-through-the-years','Stoves I\'ve collected and restored',13,220,1,NULL,0,1,0,1,1,'2009-05-15 13:05:23','2010-01-29 22:18:28'),(1343,677,12,'Playmobil : April 2009 ','playmobil-april-2009','I adore Playmobil - simple and strange. Here\'s a photo gallery of some of their April 2009 releases, from Nautical Expeditions, Police and Wedding.',88,303,NULL,NULL,0,1,0,1,1,'2009-05-19 23:40:35','2010-02-01 22:06:20'),(1344,19,1252,'50\'s Doll- Charlotte','50-s-doll-charlotte','Charlotte was my last doll I received as a young girl. She has no marks except a bunch of numbers on her skull edge. One on her back. I have no idea what company made her. I do remember she had on a turquoise gown with turquoise netting with silver threads making a design on it. ',1,73,NULL,NULL,0,1,0,1,1,'2009-05-16 12:56:07','2010-01-28 11:42:25'),(1345,19,1252,'Leah\'s Doll Collection','leah-s-doll-collection','I have lots of different types of dolls. If I have a connection when I see them then I take them home..',8,167,NULL,NULL,0,1,0,1,1,'2009-05-16 14:01:02','2010-02-01 19:47:52'),(1346,30,1253,'Canadian Forces Search and Rescue','canadian-forces-search-and-rescue','My collection of Canadian Forces Search and Rescue (SAR) memorabilia.',15,185,NULL,NULL,0,1,0,1,1,'2009-05-16 13:46:06','2010-01-31 10:32:02'),(1349,370,1258,'Pyrex Collection','pyrex-collection','Here are samples of my pyrex from the very first piece to some of my latest finds.\r\n\r\nTurquoise-\r\nChip & dip set\r\nJuice Carafe with glasses\r\nballoon bowl\r\n Butter Print cinderella bowls, fridgies and small casserole\r\n Constellation space saver.',13,190,1,NULL,0,1,0,1,1,'2009-05-17 19:19:43','2010-02-01 18:12:20'),(1350,26,1259,'\"New\" Vintage Creamer Collection','new-vintage-creamer-collection','I\'ve just discovered vintage creamers.  I\'ve had my international blue and white cows for awhile, but it wasn\'t until I became a serious coffee drinker and wanted an actual creamer to use that I noticed vintage creamers.\r\nRight now my collection consists of quite a variety.  Recently I\'ve even acquired a couple of atomic age retro creamers that are waiting to be photographed.',21,345,NULL,NULL,0,1,0,1,1,'2009-05-19 21:18:26','2010-02-01 21:30:29'),(1352,30,1248,'My Civil War Collection','my-civil-war-collection-1','These are some of the Civil War related items that I have on display in my \"War Room.\"',13,205,1,NULL,0,1,0,1,1,'2009-05-22 11:43:12','2010-02-01 13:39:46'),(1353,1,870,'Dino King and Happinet Dinosaurs','dino-king-and-happinet-dinosaurs','dino king and happinet dinosaurs',6,310,NULL,NULL,0,1,0,1,1,'2009-05-17 23:04:18','2010-01-29 14:41:31'),(1354,1,870,'Older collection pics','older-collection-pics','pictured of collection 2 yrs ago.',9,212,NULL,NULL,0,1,0,1,1,'2009-05-17 23:45:07','2010-01-30 22:24:25'),(1355,280,1260,'Salt and Pepper Shakers','salt-and-pepper-shakers-3','My collection.',16,216,2,NULL,0,1,0,1,1,'2009-05-18 13:54:22','2010-02-01 20:10:16'),(1356,764,1261,'The Lion King','the-lion-king','Some of my TLK collection, taken before i moved to the US and the stuff i brought with me here. I take pictures now and then when i have gotten some new things. TLK collected from all over the world.\r\n\r\n(website doesnt seem to be able to upload pictures atm, so the rest of the collection will come as soon as possible, also with better descriptions)',88,273,13,NULL,0,1,0,1,1,'2009-05-22 18:02:40','2010-02-01 10:37:27'),(1358,26,1259,'Light Blue Mood Kitchenalia','light-blue-mood-kitchenalia','Lately I can\'t get enough of aqua and light blue, especially dishes.  I\'ve been sharing them and meeting wonderful people!',18,280,1,NULL,0,1,0,1,1,'2009-06-25 19:49:26','2010-01-31 12:25:17'),(1360,26,1259,'Vintage & New Tupperware Fun','vintage-new-tupperware-fun','For the longest time I was a closet Vintage Tupperware fan, and then I discovered that there are lots of us!  I love mixing old and new especially if there are wonderful colors to play with.',25,332,NULL,NULL,0,1,0,1,1,'2009-07-17 07:08:55','2010-01-30 03:08:02'),(1361,2,1269,'Salt and Pepper Shaker Collection','salt-and-pepper-shaker-collection','A portion of my Grandmother\'s collection from the 40\'s, 50\'s and 60\'s',1,134,NULL,NULL,0,1,0,1,1,'2009-05-22 00:48:02','2010-02-01 19:50:42'),(1362,2,1269,'Salt and Pepper Shaker Collection','salt-and-pepper-shaker-collection-1','A portion of my Grandmother\'s collection from the 40\'s, 50\'s and 60\'s',1,89,NULL,NULL,0,1,0,1,1,'2009-05-22 00:48:48','2010-02-01 16:28:30'),(1366,280,1270,'Salt and Pepper Shakers','salt-and-pepper-shakers-5','As kitschy as possible.  ',45,322,9,NULL,0,1,0,1,1,'2009-06-25 21:54:24','2010-02-01 15:29:42'),(1368,21,1270,'Furry Fellas','furry-fellas','Furry figurines.',5,139,NULL,NULL,0,1,0,1,1,'2009-05-23 12:13:15','2010-01-29 10:49:32'),(1369,677,591,'PlayVison','playvison','The company released sets of prehistoric animals. They release a line of Dinosaurs, prehistoric mammals, amphibians, and reptiles. All are highly sought after by collectors and command top dollars. Some really interesting animals were releases, many never before or since seen in the toy world. They also released a dinosaur line for the AMNH.',26,478,NULL,NULL,0,1,0,1,1,'2009-05-23 15:39:56','2010-02-01 17:01:24'),(1370,140,1270,'Vintage Banks','vintage-banks','Piggies and otherwise...',21,143,NULL,NULL,0,1,0,1,1,'2009-05-24 13:17:52','2010-02-01 02:26:05'),(1372,2,1212,'Blacks on Crate Labels','blacks-on-crate-labels','I collect crate labels from the pre-civil rights era. While these labels are racist and offensive, I appreciate them for their artwork. I also believe that they are important historical artifacts to preserve as a reminder that this type of product labeling should never be tolerated again.\r\n\r\nBelow is a small sampling of the Original Black Crate Labels that are a part of The Museum of UnCut Funk Collection.',8,209,NULL,NULL,0,1,0,1,1,'2009-05-24 23:45:06','2010-01-30 03:28:29'),(1373,527,1274,'Cameras','cameras-2','Vintage Cameras. Range Finders, SLRs, Folders, etc.',3,105,NULL,NULL,0,1,0,1,1,'2009-05-26 17:09:05','2010-01-28 11:47:13'),(1374,235,1274,'Clocks and Watches','clocks-and-watches-1','Some of my clocks and wrist watches',6,171,2,NULL,0,1,0,1,1,'2009-05-28 14:04:33','2010-01-29 23:39:04'),(1375,258,1275,'Carnegie Collection','carnegie-collection','Collection of Dinosaurs from the Carnegie Collection line.',4,969,5,NULL,0,1,0,1,1,'2009-06-19 14:43:27','2010-02-01 09:19:52'),(1376,2,1276,'Michael Ehrlichs NIkes','michael-ehrlichs-nikes','not recent. i will take recent ones soon',13,94,NULL,NULL,0,1,0,0,0,'2009-05-27 18:19:17','2010-01-28 11:38:15'),(1377,280,1277,'Salt and Pepper Shakers','salt-and-pepper-shakers-4','Salt and Pepper shakers',20,217,1,NULL,0,1,0,1,1,'2009-05-30 07:28:12','2010-01-31 04:48:14'),(1378,0,1277,'Department 56','department-56','Mostly christmas in the city village',6,219,NULL,NULL,0,1,0,1,1,'2009-05-30 07:37:24','2010-01-30 09:49:29'),(1380,19,1268,'Madame Alexander Dolls','madame-alexander-dolls','Collection of Madame Alexander dolls, circa early 1970\'s.  Includes Poor Cinderella, Heidi, Goldilocks, Sleeping Beauty, Meg from Little Women, Rebecca of Sunnybrook Farm, McGuffey Anna, and Elise.',9,406,2,NULL,0,1,0,1,1,'2009-05-28 02:41:05','2010-01-31 19:46:05'),(1381,26,1279,'My insane collection','my-insane-collection','Well, here it is... Pyrex galore.  You\'ll also find some really neat vintage kitchen appliances, vintage Tupperware, and some Rubbermaid too.  ',NULL,42,NULL,NULL,0,1,0,1,1,'2009-05-28 16:27:57','2010-02-01 18:49:39'),(1382,26,1279,'My insane collection','my-insane-collection-1','Well, here it is... Pyrex galore.  You\'ll also find some really neat vintage kitchen appliances, vintage Tupperware, and some Rubbermaid too.  ',NULL,36,NULL,NULL,0,1,0,1,1,'2009-05-28 16:28:49','2010-01-29 23:09:51'),(1383,16,1212,'Golden Legacy Series of Black History Comic Books','golden-legacy-series-of-black-history-comic-books','Bertram A Fitzgerald is the publisher of the Golden Legacy Series of Black History Comic Books. During the decade between 1966 and 1976 he acted as editor and publisher for the series and wrote almost half the books. To read more about the series please visit The Museum of UnCut Funk blog Can\'t Get Enough...Og That Funky Stuff at www.museumofuncutfunk.com',17,260,NULL,NULL,0,1,0,1,1,'2009-05-29 00:08:26','2010-02-01 19:50:45'),(1385,252,1284,'Manga Collection','manga-collection-1','I current own approximately 570+ manga. I collect only original japanese language manga (collection was started in 1994). There are far too many, I\'m not sure I have the energy to photograph all of my manga, so here are just a few shots of some of the more important items.',15,964,5,NULL,0,1,0,1,1,'2009-06-08 01:08:59','2010-02-01 21:28:06'),(1386,19,1284,'Blythe, Licca & Other Japanese Dolls','blythe-licca-other-japanese-dolls','I\'ve only been collecting dolls for a short time, but I feel they compliment my manga collection on the shelf. I have 10 bythes, 1 petit blythe, 5 liccas, and 1 momoko... for now.',15,575,3,NULL,0,1,0,1,1,'2009-09-12 20:30:27','2010-02-01 06:28:13'),(1387,1,1285,'Action Figures','action-figures-3','Various Action Figures that I have collected. They are from various animes and video games.',28,203,NULL,NULL,0,1,0,1,1,'2009-05-30 01:14:06','2010-01-31 22:59:07'),(1388,250,1285,'Manga','manga','Actually its the combined collection of my husband and I. My manga collection alone is worth $1380 with 192 items as of today. (There is a site where it keeps track of it at http://www.justmanga.com/vmb/6553). My husbands collection is worth $2129 with 222 items. The shelves is our combined collection. ',10,324,3,NULL,0,1,0,1,1,'2009-05-30 01:07:50','2010-01-30 19:31:41'),(1389,164,1285,'Plushies','plushies','Here are my plushes. I\'ve found the Pokemon plushies sell on ebay for $20 each. This means I have $100 shelves. I\'ve gathered many of my plushes from various conventions.',15,174,NULL,NULL,0,1,0,1,1,'2009-05-30 01:32:05','2010-02-01 17:02:27'),(1390,2,1285,'Anime Key Chains','anime-key-chains','Here is my collection of anime key chains and charms. Each item usually runs about $3 to $4.',1,207,NULL,NULL,0,1,0,1,1,'2009-05-30 01:39:31','2010-01-29 14:53:36'),(1391,2,1285,'Pins and Buttons','pins-and-buttons','Usually of anime characters. Each pin runs about $2 to $3. I used to have them all on a bag until it got too heavy.',9,185,NULL,NULL,0,1,0,1,1,'2009-05-30 01:48:44','2010-02-01 08:41:57'),(1392,42,1285,'Star Trek xi stuff','star-trek-xi-stuff','I became a fan thanks to the movie. I was always interested but nothing really got me into it before this movie. Now I\'m hooked and even going back to get into the TOS stuff.',6,243,NULL,NULL,0,1,0,1,1,'2009-05-30 01:53:08','2010-01-30 11:30:08'),(1393,280,1286,'Salt & Pepper Shakers - English','salt-pepper-shakers-english','Novelty salt & pepper shakers and cruet sets - English.',27,419,2,NULL,0,1,0,1,1,'2009-05-30 06:49:34','2010-02-01 17:14:49'),(1394,765,1282,'Cookie Jars','cookie-jars-1','A collection of vintage and contemporary cookie jars amassed over the past 22 years.',32,269,NULL,NULL,0,1,0,1,1,'2009-05-30 11:35:51','2010-01-31 13:45:36'),(1395,2,1212,'Black Fashion Ads','black-fashion-ads','From the archives of The Museum of UnCut Funk Flagg Brothers Couture. For a trip down memory lane in funky mens fashion please visit www.museumofuncutfunk.com and read our Can\'t Get Enough of That Funky Stuff blog.',8,551,2,NULL,0,1,0,1,1,'2009-05-30 11:07:21','2010-02-01 09:28:57'),(1396,2,1191,'Vintage Luggage','vintage-luggage','Vintage suitcases and luggage.',4,157,NULL,NULL,0,1,0,1,1,'2009-05-30 15:00:58','2010-01-31 07:02:04'),(1397,26,1288,'salt and pepper collection','salt-and-pepper-collection','salt and pepper shakers',NULL,23,NULL,NULL,0,1,0,1,1,'2009-05-30 16:03:21','2010-01-05 13:04:39'),(1398,2,1290,'Jewelry Boxes','jewelry-boxes','10\" x 6 3/8\" x 5\" Wooden jewery box with a 3 3/8\" roman numeral removable key wind-up clock with an \"on and off \" lever type switch on side of box.Hinged lid and 1 small drawer.Circa 1966',NULL,48,NULL,NULL,0,1,0,1,1,'2009-05-30 22:52:29','2010-01-28 04:37:46'),(1399,280,1263,'Bonnie\'s Salt & Pepper Shakers','bonnie-s-salt-pepper-shakers','My collection of S/P Shakers began in 1995.  I inherited several boxes when my Aunt passed away.  I now have two corner Curio cabinets full plus more.  I have many from Japan and Occupied Japan.  Wooden, Metal, Glass, Ceramic, Souvenir, Animals, Figural, Characters...just about anything and everything',41,276,3,NULL,0,1,0,1,1,'2009-06-06 12:36:32','2010-01-30 13:40:45'),(1400,2,1286,'Salt & Pepper Shakers - German','salt-pepper-shakers-german','A selection of German sets from my novelty salt & pepper shaker collection.  Hope you like them!',19,397,1,NULL,0,1,0,1,1,'2009-05-31 12:07:24','2010-02-01 19:39:47'),(1401,2,1286,'Salt & Pepper Shakers - Japanese','salt-pepper-shakers-japanese','Aselection of japanese sets from my collection - hope you enjoy them!',22,545,2,NULL,0,1,0,1,1,'2009-05-31 12:56:25','2010-01-31 19:26:18'),(1402,2,1212,'Broadway in Black','broadway-in-black','Please visit www.museumofuncutfunk.com and read our Can\'t Get Enough of That Funky Stuff blog on Broadway in Black.\r\n\r\n',7,170,NULL,NULL,0,1,0,1,1,'2009-05-31 17:06:15','2010-02-01 19:50:46'),(1403,252,1293,'Manga manga and well..... manga','manga-manga-and-well-manga','2 years ago i started with it and it growns to a big collecton about 200 to 300 books, of course i trade some with others so i dont have all my books anymore',15,228,NULL,NULL,0,1,0,1,1,'2009-06-01 13:16:40','2010-01-31 18:09:10'),(1404,250,1292,'My Manga Collection','my-manga-collection','Collection of my manga',NULL,31,NULL,NULL,0,1,0,1,1,'2009-06-01 13:16:18','2010-02-01 09:28:43'),(1405,250,1292,'Japan Souvenirs','japan-souvenirs','Souvenirs I bought from Japan. Includes anime, manga, figures, and games.',NULL,39,NULL,NULL,0,1,0,1,1,'2009-06-01 13:18:18','2010-01-29 02:37:08'),(1406,252,1294,'Manga Collection','manga-collection','This is my large collection of manga books consisting of over 140 books!',28,349,4,NULL,0,1,0,1,1,'2009-06-02 17:54:48','2010-01-31 00:35:36'),(1407,115,1295,'Anime Figurines','anime-figurines','This is my humble collection of anime figures - most of them Gashapon.  If it seems like most of them are from Naruto it\'s because...wait for it...they are.  *laughs*  Not because it\'s my favorite show or anything, but because in a lot of cases it was cheaper for me to buy a whole set of figures than just the character I wanted.  Yeah, I know, how dumb is that?  ;-P',55,536,4,NULL,0,1,0,1,1,'2009-06-04 03:19:16','2010-02-01 21:02:42'),(1421,765,1281,'Cookie Jars','cookie-jars-2','Fapco Windmill Cookie Jar',18,449,5,NULL,0,1,0,1,1,'2009-06-10 16:44:54','2010-02-01 17:50:06'),(1422,258,1281,'Head Vases','head-vases',' 1959 Napco Head Vase',39,187,4,NULL,0,1,0,1,1,'2009-06-03 23:41:34','2010-01-28 21:40:21'),(1423,252,1296,'Manga&Anime','manga-anime','I got into manga and anime through the popular animes brought to North American early on, like Pokemon and Sailormoon. I eventually found the Japanese version of Sailormoon which led to many other lovely and wonderful discoveries. I then found the manga adaptions and it\'s been love ever since :)',14,181,NULL,NULL,0,1,0,1,1,'2009-06-02 19:00:19','2010-02-01 15:58:22'),(1424,26,1194,'Dianne Salt and Pepper Collection','dianne-salt-and-pepper-collection','Two Monkey and Baby Sets, Two Kangaroo and Joey Sets, Black Cat with nodding head and paw, White Cat with nodding head and paw, Black cat with Kitten, Spike nodders (The head nods on a spike) monkey, cat, dog and bear (The head is one shaker and the body is the other)',8,260,2,NULL,0,1,0,1,1,'2009-06-02 18:46:02','2010-01-31 23:01:05'),(1425,2,1281,'Royal Copley','royal-copley','Royal Copley bonnet wall pocket.  This is the larger bonnet.',8,250,5,NULL,0,1,0,1,1,'2009-06-03 14:17:39','2010-02-01 15:29:44'),(1428,252,1298,'Sailor Moon','sailor-moon','this are my little collection ^^',16,268,2,NULL,0,1,0,1,1,'2009-06-04 09:10:10','2010-01-31 19:07:04'),(1429,19,1298,'My Cuties','my-cuties','this are few Pics from my cute Dolls',16,154,2,NULL,0,1,0,1,1,'2009-06-04 08:45:17','2010-01-31 07:57:05'),(1430,677,591,'Happinet vinyl figures','happinet-vinyl-figures','Another larger sized set of figures from Japan! It\'s nice to have some bigger sized figures intead of the small Kaiyodos and the likes.\r\nThe Happinet figures are very similar in size to the SEGA Dinoking, another Japanese line.\r\nThere are 27 figures in all in the collection. I have, to date, 8 of them.\r\nThe figures are sculpted by famed Japanese artist Kazunari Araki. He have done some fantastic figures.\r\nUnfortunately, the Happiner figures are not sold outside of Japan. They can be hard to find.',17,342,NULL,NULL,0,1,0,1,1,'2009-06-04 13:42:47','2010-02-01 23:42:30'),(1431,26,1266,'Salt and pepper shakers','salt-and-pepper-shakers-6','Adorable and practical...',16,237,NULL,NULL,0,1,0,1,1,'2009-06-04 21:17:55','2010-02-01 03:45:46'),(1432,252,1295,'Manga, Manhwa, & Ameri-manga (OELs)','manga-manhwa-ameri-manga-oels','I\'ve been working on this collection probably since around 2002.  What\'s left of my paycheck each month goes into the obsession you see here.  *laughs*  \r\n\r\nThis isn\'t the complete collection yet...I\'ve still got at least two more bookshelves that need to be sorted and straightened before I can take pictures of them.  ^_^;  Regardless, please feel free to browse and enjoy.\r\n\r\nOh, and for those of you interested in stats, I own approximately 2210 titles with a total expenditure of approximately $23,450.  My 5 top genres include: Drama, Fantasy, Romance, Action/Adventure, Comedy.  My top two publishers (unsurprisingly) are Tokyopop and Viz.\r\n\r\nAll the stats were obtained by using Justmanga.com\'s Virtual Manga Bookshelf.',26,341,NULL,NULL,0,1,0,1,1,'2009-06-08 03:08:48','2010-02-01 03:52:29'),(1434,252,1301,'Manga','manga-1','From action to romance, comedy and drama, the fantastic to the mundane, there\'s quality manga to be found whatever your passion.  For me, it tends toward science fiction and the comedic, though there\'s a bit of everything to be found in my collection.\r\n\r\nIn fact, Gunnm, or Battle Angel Alita as it is better known in the West, is not only my favorite manga series, but pretty much one of my favorite stories altogether, and my love for it has even seen me import several volumes, including paying close to $100 for one, just for the limited edition Revoltech figure that came with it, simply because there aren\'t any other \'proper\' figures of Gally/Alita to be found.\r\n\r\nWith the walls of manga that are available at many major bookstores and comic shops, I am actually somewhat picky about what comes home with me. Anime plays a large role in this, where if I enjoyed what I\'ve watched, I\'ll often go out and pick up the manga for more time with the characters/world. Beyond that though, my purchases will be driven by the concept or the art, preferably both, and occasionally I\'ll track down works by a particular creator, like Yukito Kishiro and Masamune Shirow.',15,209,NULL,NULL,0,1,0,1,1,'2009-06-08 05:41:05','2010-01-31 20:21:19'),(1435,685,993,'My antelopes and gazelles collection','my-antelopes-and-gazelles-collection','Here are the gazelles and antelopes figurines which lived in my personnal savannah.',47,634,18,NULL,0,1,0,1,1,'2010-01-28 17:09:36','2010-01-30 17:45:37'),(1436,11,572,'ELVIS PRESLEY THE KING VINTAGE NEWSPAPERS ','elvis-presley-the-king-vintage-newspapers',' 9 Original Vintage Elvis themed Newspapers and Magazine.\r\nOver 30 years old.\r\n',11,354,NULL,NULL,0,1,0,1,1,'2009-06-08 17:52:20','2010-02-01 22:04:14'),(1437,258,1299,'Salt and Pepper Shakers','salt-and-pepper-shakers-7','This is a collection I have inherited and am looking to sell. ',1,98,NULL,NULL,0,1,0,1,1,'2009-06-08 20:04:48','2010-02-01 19:50:48'),(1438,252,1303,'Lord Tains\' manga collection','lord-tains-manga-collection','160, most of which are Shounen Jump(sorry, but they buy all the great series!)',19,251,NULL,NULL,0,1,0,1,1,'2009-06-09 13:22:19','2010-01-30 14:13:29'),(1439,771,993,'Rhinoceros - Neushoorn - Rhinocros','rhinoceros-neushoorn-rhinoceros','My rhino collection',20,489,11,NULL,0,1,0,1,1,'2010-01-28 17:17:04','2010-01-31 20:11:27'),(1440,1,847,'Toys and Whatnot','toys-and-whatnot','Things that make my room look like it belongs to a 14 year old boy.',13,146,NULL,NULL,0,1,0,1,1,'2009-06-15 19:53:16','2010-01-24 16:47:42'),(1441,754,847,'Vinyl Toys','vinyl-toys','Mostly dunnies',8,160,NULL,NULL,0,1,0,1,1,'2009-06-10 11:24:16','2010-01-30 02:06:19'),(1442,765,791,'Cookie Jars','cookie-jars-3','Cookie Jars',193,512,4,NULL,0,1,0,1,1,'2009-06-19 14:21:05','2010-02-01 13:59:00'),(1443,21,809,'Metal Brass Pewter Bronze Dinosaur Figures','metal-brass-pewter-bronze-dinosaur-figures','All of the metal dinos will be in this gallery',12,346,NULL,NULL,0,1,0,1,1,'2009-11-22 02:56:12','2010-02-01 21:06:48'),(1445,1,1306,'Salvat Dinosaur Collection','salvat-dinosaur-collection','A collection made by Salvat Editores from Spain and sold in part of Europe and Latin America in 2001. The collection there are 40 dinosaur models based on museum lines of dinosaurs, like Bullyland, Battat, Carnegie...\r\nThere are 40 magazines, one for each specie of prehistoric animal. The models are a little bit ugly, but some of them are cool.\r\nThe official name of this collection in portuguese is Descobrindo o Mundo dos Dinossauros.\r\n',51,585,1,NULL,0,1,0,1,1,'2009-06-14 18:53:53','2010-01-31 18:24:35'),(1446,26,1312,'Ice Screamers','ice-screamers','various ice cream memorabilia',14,71,NULL,NULL,0,1,0,1,1,'2009-06-12 09:53:57','2010-01-30 03:29:52'),(1447,21,1313,'My Rhino\'s','my-rhino-s','These are the models of my rhino models at the moment.',45,428,2,NULL,0,1,0,1,1,'2010-01-20 21:01:54','2010-02-01 13:24:05'),(1448,1,12,'Mr. Bean 1/6th Figure','mr-bean-1-6th-figure','Mr. Bean