g-bras','These are just a sample of the vintage training bras I need for my collection. Almost anything Teenform and Teencharm brand is desired. Other brands upon offer.',14,1649,NULL,NULL,0,1,0,1,1,'2009-06-23 18:24:08','2010-02-01 18:28:18'),(1521,677,591,'Deluxe 2009 CollectA/Procon figures','deluxe-2009-collecta-procon-figures','Here they are CollectAs 2009 deluxe figure collection, series 2! So what can be said about the set? Well, for starters, unlike last years offering (heavy on meat eaters), this years set is composed of herbivores. No meat-eating predators in this group. The range of species is interesting in that the choices are both familiar and yet underrepresented in the toy line industry.\r\nThe mammoth and Stegosaurus are both all time classic favorites, one of the bread and butter species for the industry. Scelodosaurus and Paraceratherium (also know as Indricotherium & Baluchitherium) both have enjoyed popularity in the early years, but faded from popularity in later decades. They are the comeback kids!\r\nThe brand new offerings, also their debut as toy figures, in the deluxe line are the Hylaeosaurus, Paralatitan, and Nigersaurus.',10,525,NULL,NULL,0,1,0,1,1,'2009-06-23 20:31:59','2010-02-01 06:57:13'),(1522,18,1327,'Lion King Plush Toys Collection','lion-king-plush-toys-collection','Here are my Plush toys. All are for sale. Please make an offer!\r\nAll items come from a smoke-free, child-free environment. http://www.flickr.com/photos/surehope/',8,563,7,NULL,0,1,0,1,1,'2009-06-24 08:54:59','2010-02-01 06:42:07'),(1523,2,1333,'Horror Stuff','horror-stuff','This is it.....what else can I say',NULL,26,NULL,NULL,0,1,0,1,1,'2009-06-23 23:15:01','2010-01-03 18:05:08'),(1524,772,1327,'Lion King Collection','lion-king-collection','This collection includes everything but my books and plushies! All are for sale. Please make an offer! All items come from a smoke-free, child-free environment. The Lion King Collection + Plushies + Books available as a bulk lo