8:44','2010-02-01 04:10:20'),(1570,330,1374,'The X Files','the-x-files','Memorabilia of the 90\'s series tv The X Files sales overworld, signs, rare items, limited items, spanish and english editions, etc.',6,68,NULL,NULL,0,1,0,1,1,'2009-07-15 07:56:48','2010-01-31 18:34:16'),(1571,24,1371,'Pyrex','pyrex','Pyrex',2,33,NULL,NULL,0,1,0,1,1,'2009-07-15 10:17:23','2010-01-19 00:14:57'),(1572,21,1317,'Unknown maker animals!!!','unknown-maker-animals','You know my profile?No...?!Then let me remind you than when I was 2 years old I had some animal toys by unknown makers.By 5,I had 500 of them.At six,I started collecting hand-painted animals.Now I only have 200 China toys.Imagine how it was with 500 after you see my collection ;) Have fun!',21,331,4,NULL,0,1,0,1,1,'2009-07-16 09:18:27','2010-02-01 17:20:49'),(1573,767,1242,'Camera Collection','camera-collection','I have been collecting camera for some time now, I find them at 2nd hand shops and often get given them. ',27,182,5,NULL,0,1,0,1,1,'2009-07-15 14:08:43','2010-02-01 06:57:16'),(1574,24,791,'Pyrex','pyrex-1','Pyrex',130,176,NULL,NULL,0,1,0,1,1,'2009-07-15 15:08:32','2010-02-01 07:20:20'),(1575,685,791,'Vintage toys','vintage-toys','Vintage toys',7,139,3,NULL,0,1,0,1,1,'2009-07-15 16:53:35','2010-01-30 15:49:28'),(1576,770,1375,'Motorcycle Collection/Harley Davidson','motorcycle-collection-harley-davidson','These are photos of my Motorcycle Collection ranging from 1926 to 2000 that are currently on display at Docs Motorcycle Shop, Waterbury, Ct. PLEASE VISIT DOCSMC.COM',13,373,10,NULL,0,1,0,1,1,'2009-07-16 13:51:27','2010-01-31 19:08:25'),(1577,770,1353,'Harley-Davidson Factory memorabilia','harley-davidson-factory-memorabilia','I started collecting Harley-Davidson memorabilia more than 20 years ago, but about 10 years ago I focused on vintage Harley-Davidson letterheads, as these are very nice looking, sometimes very interesting and most of all, I can store all of them in a reduced space. Parts, tools and other stuff was taking to much space. Somebody from the Harley-Davidson Archives in Milwaukee, once told me I have about the same amount of these letters as the Archives have, as they didn\'t keep many of these letters. I sincerely don\'t know if that\'s true or not, as it\'s very difficult to have access to these archives... Anyhow, I scanned all these old letters and put them online on my small site, which is called www.hardavmocy.com\r\nHardavmocy was the name of the cable address, mentioned on all Harley-Davidson letterheads between 1913 and 1958 (approximately). ',17,256,NULL,NULL,0,1,0,1,1,'2009-07-17 12:04:46','2010-01-30 19:15:48'),(1581,685,993,'TAPIRS','tapirs','My small tapir figures collection.',9,154,2,NULL,0,1,0,1,1,'2010-01-30 22:31:26','2010-01-31 14:37:53'),(1582,32,1375,'Motorcycle Collection','motorcycle-collection','These are photos of my Motorcycle Collection ranging from 1926 to 2000 that are currently on display at Docs Motorcycle Shop, Waterbury, Ct. PLEASE VISIT DOCSMC.COM',10,173,2,NULL,0,1,0,1,1,'2009-07-17 11:15:06','2010-01-29 17:58:50'),(1583,563,1368,'Transformers Aircraft','transformers-aircraft','Flying guys!',13,170,NULL,NULL,0,1,0,1,1,'2009-07-18 03:08:18','2010-01-29 15:17:43'),(1584,770,1381,'motorcycle toys','motorcycle-toys','Any toy with two wheels and a motor',21,234,NULL,NULL,0,1,0,1,1,'2009-07-18 21:23:12','2010-02-01 19:23:00'),(1585,390,1383,'collectSPACE Space Artifacts','collectspace-space-artifacts','Space artifacts from the collectSPACE.com collection. ',15,201,NULL,NULL,0,1,0,0,0,'2009-07-20 10:17:38','2010-01-29 17:00:13'),(1586,21,1306,'Safari Collection','safari-collection','...',43,285,2,NULL,0,1,0,1,1,'2009-07-20 21:08:09','2010-01-30 07:40:30'),(1587,779,1386,'Huge Power ranger collection','huge-power-ranger-collection','for sale, http://cgi.ebay.com/ws/eBayISAPI.dll?ViewItem&ssPageName=STRK:MESELX:IT&item=250469046058\r\n\r\nhuge absolutely huge auction',10,372,4,NULL,0,1,0,1,1,'2009-07-20 21:19:28','2010-02-01 18:56:53'),(1589,685,993,'Pinnipedia - Pinnipedes','pinnipedia-pinnipedes','My collection of pinnipede mammals toys. As usual, the figures are from the early XXth century to nowadays.',31,186,4,NULL,0,1,0,1,1,'2009-12-08 13:31:20','2010-01-30 09:49:31'),(1590,773,1390,'M&M Dispensers','m-m-dispensers','M&M Dispensers, large and small. Some very rare.',113,1022,7,NULL,0,1,0,1,1,'2009-07-29 12:53:16','2010-02-01 20:58:37'),(1591,23,1369,'Silent Hill Collection: Games and Demos','silent-hill-collection-games-and-demos','All of my Silent Hill games and Demos',19,65,NULL,NULL,0,1,0,1,1,'2009-07-21 20:07:09','2010-01-30 08:50:53'),(1592,23,1369,'Silent Hill Collection: Books and Guides','silent-hill-collection-books-and-guides','Silent Hill Guides, Comics, and book from the US, Japan and Europe',24,156,1,NULL,0,1,0,1,1,'2009-07-29 16:11:59','2010-01-30 18:26:22'),(1593,685,993,'African elephants - Elephants d\'Afrique','african-elephants-elephants-d-afrique','My herd of african elephant figure toys.',16,180,NULL,NULL,0,1,0,1,1,'2009-08-01 07:37:15','2010-02-01 19:38:58'),(1594,677,591,'CollectA ( Procon) 2009 medium figure','collecta-procon-2009-medium-figure','CollectA 2009: Medium figures.\r\nWow, finally got them all! So what can be said about the 2009 collection?\r\nFirst, the quality and detailing have vastly improved compared to their earlier collections. True to their goal of releasing many species previously unseen as toy figures, they have produced an astonishing diversity of figures.\r\nThe ranges of species encompass the entire globe! In all, there are 18 figures in the medium sized group. The diversity is overwhelming to say the least.\r\nThere are some old favorites making a comeback such as well as some brand new offerings. Sauropods, ceratopsians, the duckbills, Theropods, are all big this year and are well represented. The pterosaurs group is mysteriously not represented this year. The marine reptiles have just one representative, a tylosaur.\r\nCollectA easily doubled the number of figures released this year with a combined total of 25 figures plus some plants! They released the most figures, more than Safari, Schleich, Bullyland, and Papo all combined. What Safari lack in diversity of species, they made up with their release and what they lack in accuracy, Safari made up with their releases.\r\nIt really is nice to see how CollectA has grown and improved the last two years. For a young company who just entered the scene 3 years ago, they have come a long way! Improvements can be seen on most of their new figures. There are still some that are forgettable, like the megalosaurus. Overall, and I maybe the only one who think so, the figures are great. What I find fun about the CollectA/Procon collection is that its nice to see how they grow and improve each year. It is not often that we can watch a company improve after their initial release. Too often a company burst into the scene with such great promise, only to fizzle and eventually face extinction without having the opportunity to reach their full potential. Like Safari before them, we can see improvement in each successive release. I hope that the trend of quality figures continue in the years to come. I have no doubt, and again I am sure I am in a minority here, that given a few more years, CollectA will fully reach their full potential. Again, Safari is a good example; it has taken them more than two decades to reach the quality and accuracy that their new releases now enjoy. To date, CollectA/Procon has proven that they can be a major player in the toy figure market.\r\nWith Schelich contracting and limiting their releases to just a few tried and proven figure; Bullyland releasing forgettable, barely registering figures; and Papo, all but abandoned prehistoric this year (a underperforming mammoth, with a striking resemblance to Schleichs), its been a head-to-head year between Safaris exquisite figures and CollectAs diverse collection. There is no comparing the two line, they both compensate for what the other lack therefore balancing this years offerings.\r\nBoth companies employed very different tactics in dealing with their new releases.\r\nSafari went the way of producing truly amazing, exquisitely detailed figures. In a way, it is inevitable that Safari has to raise the bar on them. They have been a leader in many ways.\r\nCollectAs strategy is to mine the species diversity and offer as many new figures, many brand new offerings and never been seen as toy figures. Its catching up with the big guyswith a twist.\r\nas Cetiosaurus (standard sauropod, but nicely done. Previously seen only in the Invicta line) and megalosaurus (another Invicta original. Unfortunately, this figure is not any better than its predecessor)\r\n ',33,566,NULL,NULL,0,1,0,1,1,'2009-07-22 18:17:42','2010-01-31 19:35:51'),(1595,685,993,'Asian Elephants - Elephants d\'Asie','asian-elephants-elephants-d-asie','My herd of asian elephants figures',22,176,NULL,NULL,0,1,0,1,1,'2010-01-28 17:21:29','2010-02-01 19:42:58'),(1596,258,1341,' the winged jewels chinese cloisonne','the-winged-jewels-chinese-cloisonne','Here is a set of the ching-t-ai-lan artists workshop the winged jewels chinese cloisonne birds and flowers collection its a set of 8 collector plates.The plates came out in 1991 -1993.The plate names are the azure magpie,long tailed titmouse,the rosy minivet,the kingfisher,the oriole,the flower pecker,the pekin robin and the shrike.All plates have there boxs and shipping boxs they came in and all the paper work with each plate.I have seen the plates on websites going for $ 125.00 per plates from the set.To me i have not seen may on ebay and to have a complete set in one shot i think is rare.I think it would be great to display in a house in or in a chinese restaurant.If you have a offer that you may think that is reaonable for the set email me will to work with you. \r\n',8,137,NULL,NULL,0,1,0,1,1,'2009-07-23 07:55:05','2010-02-01 15:27:42'),(1597,390,139