7:21'),(1651,773,1384,'M&M\'s Collection Part 1','m-m-s-collection-part-1','A small part of my M&M\'s collection',17,385,5,NULL,0,1,0,1,1,'2009-08-04 11:39:52','2010-02-01 22:41:24'),(1652,273,1433,'OOAK Spooky Dollhouse Miniatures in 1:12 scale','ooak-spooky-dollhouse-miniatures-in-1-12-scale','These are the pieces I have made for my Etsy store.  I both make and collect spooky dollhouse miniatures in 1:12 scale, loving handmade and one of a kind pieces (ooak).  Spooky may be elegant gothic, dark fairy, or ceremonial wizardry...  it doesn\'t always have to be about Halloween although I do make both vintage and quirky fun Halloween themed items too!  I love the dark holdiay...  I\'m influenced by Harry Potter, mythology, Steampunk, Victorian, Gothic, and all aspects of magic!  ',17,397,NULL,NULL,0,1,0,1,1,'2009-08-04 19:52:37','2010-02-01 17:30:49'),(1653,21,1313,'My Animal Enclosures,Zoo-Cages,Fences ect.','my-animal-enclosures-zoo-cages-fences-ect','These are all my animal related enclosures,in which animals live or stay.\r\nThey can be diorama\'s or parts of them to.\r\nThere are complete zoo\'s,zoo-cages and all kinds of stuff.\r\nSee from time to time,if there is something new added.',87,407,6,NULL,0,1,0,1,1,'2010-01-27 19:17:00','2010-02-01 12:44:59'),(1654,33,1440,'Harry Potter Obsession','harry-potter-obsession','my harry potter collection',10,161,1,NULL,0,1,0,1,1,'2009-08-07 12:24:39','2010-01-31 07:06:28'),(1655,21,1313,'My Trees,Bushes and other Plants','my-trees-bushes-and-other-plants','These are the trees,bushes and other plants in my collections.\r\nthose are mostly used as decorations to the animal-collections.',10,278,2,NULL,0,1,0,1,1,'2010-01-03 15:21:58','2010-02-01 12:17:07'),(1656,769,1445,'Harry Potter Goodness','harry-potter-goodness','My collection of Harry Potter',74,179,1,NULL,0,1,0,1,1,'2009-08-10 17:43:53','2010-01-30 11:35:35'),(1657,19,1445,'Living Dead Dolls','living-dead-dolls-4','These are my Living Dead Dolls so far',81,687,1,NULL,0,1,0,1,1,'2009-08-10 14:23:13','2010-02-01 13:22:53'),(1658,685,591,'Starlux','starlux',' I know, like everything else, it\'s not everyone\'s cup of tea.\r\nStarlux is a French company that produce many lines of toy figures. They are old, many circa 1960 -70\"s.  The material used to make the figures are brittle, making it hard to find figures that are intact. The paint is also fragile, they chip off easily.\r\nStarlux released many figures, from Soldiers, modern animals, to prehistoric. I don\'t think they were widely available outside of Europe, but I maybe wrong.\r\nI was first introduced to the line many years ago when a friend gave me a Starlux Styracosaurus to add to my ceratopsian collection. Out of curiosity, I did a search and found that there is a long list of prehistoric figures from them. Unfortunately, I could not locate any source until I found the joy of evil-bay!\r\nEven then, it was hard to find any Starlux figures and if they do show up, command some serious dollars! So it was a slow attempt to build up the collection. When my interest in prehistoric mammals ( and other non-dinosaurs) developed, I quickly gave up trying to acquire the dinosaurs and instead concentrated my effort ( and $$$) in procuring the mammals, fish, and other non-dinosaurs. I\'m an opportunity, so I still occasionally get some dinosaurs if I find a good deal. Starlux, to date, has some of the most diverse list of prehistoric mammals ( and other non-dinosaurs) ever assembled and produced. Many species were produced for the first time and, unfortunately, never been seen/produced again.\r\nThe list is astonishing! Now we know what footprints CollectA/Procon is following.\r\nThe sculpting is obviously very retro, and some are just plain scary! But there are some real rare  gems in the collection like many of the mammals, fish, amphibians, and birds. For those of you who always scream accuracy, well this line is definitely not for you. For those who appreciate the vintage, the unique style, well this line is a must have to add to your collection.\r\nTo date, my collection is very small. As I already mention, they are hard to find this days and command top dollars when available. It is my hope one day I may be able to complete the mammals and other non-dino animals.\r\n',20,458,13,NULL,0,1,0,1,1,'2009-08-26 13:32:59','2010-02-01 12:55:23'),(1659,8,1447,'The Bobbsey Twins Collection of Books $198.00','the-bobbsey-twins-collection-of-books-198-00','The Bobbsey Twins by Laura Hope collection. The set includes edition numbers\r\n\r\nBooks 1-37 and 39-45 editions.  The only book missing is edition number 38 to make the entire collection complete. This is a rare opportunity to have an entire collection.\r\n\r\nAll the books in pretty fair condition with no pages missing or torn. These were my own books as a child and were precious to me. Of course they show wear. They all have their pretty cover jackets. Tweed covers under the jackets. Copyright dates inside from1947 to 1952. Smoke free home.\r\n\r\nPrice includes the entire set of 44 books or less than $5.50 a book. A real bargain since their value is $10 or more a book and priceless as a collection.\r\n',2,295,4,NULL,0,1,0,1,1,'2009-08-12 02:00:06','2010-01-31 20:26:24'),(1660,770,1456,'My Harley Collection','my-harley-collection','Different Harley-Davidson related clothing',15,137,NULL,NULL,0,1,0,1,1,'2009-08-17 09:46:02','2010-01-30 09:25:26'),(1662,21,1313,'My Insects and Spiders','my-insects-and-spiders','These are the insects and spiders in my animal-model collection.\r\nSee from time to time,because the collections are always growing.',6,172,NULL,NULL,0,1,0,1,1,'2009-08-17 16:53:31','2010-02-01 16:08:38'),(1663,775,932,'Spider-man Memorabilia ','spider-man-memorabilia','This is a collection of everything Spider-man. Not as extensive as some but I enjoy adding to the collection when I can. My favourite character aside from Spidey, is Doc Ock. Hard to pinpoint why but he\'s one interesting character for sure. ',117,162,NULL,NULL,0,1,0,1,1,'2009-09-08 14:49:13','2010-01-29 11:40:27'),(1664,2,1463,'M&Ms','m-ms','Colorful M&M characters',0,61,NULL,NULL,0,1,0,1,1,'2009-08-19 00:09:06','2010-01-24 00:10:40'),(1665,685,993,'Xenarthra, pangolins and aardvak','xenarthra-pangolins-and-aardvak','Xenarthres, pangolins et orycteropes\r\nMy collection of animal toy figures...',32,220,2,NULL,0,1,0,1,1,'2010-01-31 03:21:43','2010-02-01 21:05:10'),(1666,8,59,'Children\'s Activities Books','children-s-activities-books','Retro & vintage books & booklets for kids, including coloring books, sticker books, scratch & sniff, mazes etc.',4,119,1,NULL,0,1,0,1,1,'2009-08-25 22:54:30','2010-02-01 10:17:11'),(1667,1,1466,'X-Men by Toy Biz','x-men-by-toy-biz','X-Men The Movie Collection Still in Packages',NULL,15,NULL,NULL,0,1,0,1,1,'2009-08-19 21:44:47','2010-01-07 22:42:21'),(1668,685,993,'Lemurs - Lemuriens','lemurs-lemuriens','Here is my collection of my primates which are not monkeys.\r\nHope you enjoy it...',13,164,3,NULL,0,1,0,1,1,'2010-01-31 04:21:40','2010-02-01 19:07:01'),(1669,685,993,'PROCYONNIDAE','procyonnidae','My small collection of racoon, red pandas... toy figures.',8,171,NULL,NULL,0,1,0,1,1,'2009-12-08 10:19:28','2010-01-31 09:44:07'),(1670,685,993,'Wild Dogs - Canids sauvages','wild-dogs-canides-sauvages','My wild dogs toy figures collection.',20,360,4,NULL,0,1,0,1,1,'2010-01-30 03:37:24','2010-02-01 19:22:20'),(1671,677,993,'REPTILES !','reptiles','except Crocodiles who have their own thread, here is my reptiles toy figures collection',51,364,6,NULL,0,1,0,1,1,'2009-12-09 09:57:08','2010-02-01 15:30:00'),(1672,59,1470,'Garrard Museum','garrard-museum','A collection and a passion, I\'m constantly looking for new additions of Garrard audio items that were manufactured in Swindon, UK.',NULL,21,NULL,NULL,0,1,0,1,1,'2009-08-21 09:15:00','2009-12-26 12:01:26'),(1673,677,993,'Viverridae - Viverrids','viverridae-viverrides','My small collection of civets, linsang and gene